"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',4,0,1,'','',1,0,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(130,245,'Introducing K2','introducing-k2','','<p>You\'ve already been there... Joomla! is a great content management system. In fact it\'s considered one of the best in the world. But the default article system in Joomla! is so spartan! Just a title, your content body and that\'s it. This is where K2 comes in.</p>\r\n\r\n<img src=\"images/sampledata/ja_university/k2.png\" alt=\"K2 Introduction\" align=\"right\" title=\"K2 Introduction\" />\r\n\r\n<p>K2 was built as a complete replacement of the default article system in Joomla!. Install it like any Joomla! extension, import your articles from the default Joomla! article system and you instantly get a host of new features for your existing content: rich content forms for items (think of Joomla! articles with additional fields for article images, videos, podcasts & other audio files, image galleries and attachments), hassle-free image management (uploaded item images are auto-resized to 6 configurable dimensions, either globally or per category - you can now forget about using Photoshop resizing!), comments, tagging, built-in options to extend content forms (e.g. to create product catalogs), powerful content modules fetching K2 content in any way you can imagine, frontend editing with easy to use access control settings (for content-heavy websites), powerful yet easy templating (and sub-templating) for going above the \"Joomla! average\", extended user profiles, user groups, blogs, a powerful plugin API to extend item/category/user forms, \"drag and drop\" media manager and many more!</p>\r\n\r\n<p>K2 is the ideal solution for managing your content, regardless of site \"size\": you can use it from a small blog to a complex corporate site or even a multi-author environment (portals, magazines etc.). To provide a practical example, using K2, you can transform your Joomla! website to a news/magazine site with author blogs, product catalogs, work portfolio, knowledge base, download/document manager, directory listing, event listing and more, all this bundled under one package! And since K2 is extensible with additional fields to its base item form, you can easily create category-specific content types, e.g. article, blog post, product page, directory listing.</p>\r\n\r\n<p>It\'s no wonder that K2 powers some of the biggest and most popular Joomla! sites ever built worldwide!</p>\r\n\r\n<p>These integrated features in K2 not only save website administrators precious management time (from managing a dozen extensions which would otherwise be required), but they also allow for better performance.</p>\r\n\r\n<p>K2 was actually built on these 4 principles: feature-rich content in Joomla!, ease of use (for any type of user), flexible templating, performance</p>\r\n','',-2,0,0,9,'2012-08-24 06:43:17',42,'','2012-08-24 06:50:21',42,0,'0000-00-00 00:00:00','2012-08-24 06:43:17','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\"