,''),(144,264,'Pria Dibalik Cermin','pria-dibalik-cermin','','<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"> </p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">Ketika Anda dapatkan apa yang Anda inginkan dalam perjuangan Anda demi uang,</p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">dan dunia menjadikan Anda Raja sehari,</p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">bercerminlah, dan lihatlah apa kata pantulan diri Anda.</p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"> </p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">Sebab bukan penilaian Ayah atau Ibu atau Isteri Anda yang harus Anda penuhi.</p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">Orang yang penilaiannya paling relevan dalam kehidupan Anda adalah</p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">Justru pantulan diri Anda sendiri.</p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"> </p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">Dialah yang harus anda senangkan, lupakanlah yang lain</p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">Sebab dialah yang akan menyertai Anda sampai akhir, dan</p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">Anda akan melewati ujian yang paling sulit, paling berbahaya,</p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">Kalau pantulan diri Anda itu menjadi sahabat Anda.</p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"> </p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">Mungkin Anda seperti Jack Horner dan “memahat” sebuah korma,</p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">dan mengganggap diri Anda itu mengagumkan,</p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">tetapi pantulan diri Anda itu mengatakan  Anda payah</p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">kalau tidak berani menatap langsung ke matanya.</p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"> </p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">Anda boleh saja mengecoh seluruh dunia selama bertahun-tahun,</p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">dan mendapatkan dukungan,</p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">tetapi imbalan akhir Anda hanyalah sakit hati dan airmata,</p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">kalau anda menipu pantulan diri Anda.</p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"> </p>\n<p class=\"MsoListParagraph\" style=\"text-align: center; text-indent: -0.25in;\" align=\"center\"><!--[if !supportLists]--><span><span>-<span style=\"font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal; -x-system-font: none;\"> </span></span></span><!--[endif]-->Dale WimBrow -</p>\n<p class=\"MsoListParagraph\"> </p>\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">(From The Right To Lead – John C. Maxwell)</p>\n<p> </p>','',1,87,0,103,'2010-05-31 07:17:03',42,'','2013-03-11 04:17:54',42,0,'0000-00-00 00:00:00','2010-05-31 07:17:03','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_section\":\"\",\"link_section\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_vote\":\"\",\"show_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_pdf_icon\":0,\"show_print_icon\":0,\"show_email_icon\":0,\"language\":\"\",\"keyref\":\"\",\"readmore\":\"\"}',5,0,2,'','',1,18,'{\"robots\":\"\",\"author\":\"\"}',0,'*',''),(145,265,'Extend Your Neck','extend-your-neck','','<p class=\"MsoNormal\">Tom McConnell, president of New England Securities Cooperation, published the following guiding principles to liberate his employees from the fear or trying new things:</p>\n<p class=\"MsoNormal\"> </p>\n<ol>\n<li>Take risks. Don’t play it save</li>\n<li><span><span style=\"font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal;\"> </span></span><!--[endif]-->Make mistakes. Don’t try to avoid them</li>\n<li>Take initiative. Don’t wait for instruction</li>\n<li>Spend energy on solutions not emotions</li>\n<li>Shoot for total quality. Don’t save standards</li>\n<li>Welcome destruction. It’s the first step in the creative process</li>\n<li>Focus on opportunities not problems</li>\n<li>Experiment</li>\n<li>Take personal responsibility for fixing things. Don’t blame others</li>\n<li>Try easier, not harder</li>\n<li>Stay calm!</li>\n<li><span><span style=\"font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal;\"> </span></span><!--[endif]-->Smile</li>\n<li>Have fun!<span><span style=\"font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal;\"><br /></span></span></li>\n</ol>\n<p class=\"MsoListParagraph\" style=\"text-indent: -0.25in;\"> </p>\n<p class=\"MsoListParagraph\" style=\"text-indent: -0.25in;\"><!--[if !supportLists]--><span><span style=\"font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal;\"> </span></span><!--[endif]--></p>\n<p class=\"MsoListParagraph\" style=\"text-indent: -