people can be. They spent a day and a night in the farm of a very poor family. When they got back from their trip the father asked his son, \"How was the trip?\" \"Very good Dad!\" \"Did you see how poor people can be?\" the father asked. \"Yeah!\" \"And what did you learn?\"</p>\n<p>The son answered, \"I saw that we have a dog at home, and they have four. We have a pool that reaches to the middle of the garden, they have a creek that has no end. We have imported lamps in the garden, they have the stars.Our patio reaches to the front yard, they have a whole horizon.\"When the little boy was finishing, his father was speechless.His son added, \"Thanks Dad for showing me how poor we are!\"</p>\n<p> </p>\n<p><strong>Lessons</strong> : <em>Isn\'t it true that it all depends on the way you look at things? If you have love, friends, family, health, good humor and a positive attitude towards life you\'ve got everything! You can\'t buy any of these things, but still you can have all the material possessions you can imagine, provisions for the future, etc., but if you are poor of spirit, you have nothing!</em></p>','',1,87,0,103,'2010-02-10 03:18:48',42,'','2013-03-11 04:17:54',42,0,'0000-00-00 00:00:00','2010-02-10 03:18:48','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_section\":\"\",\"link_section\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_vote\":\"\",\"show_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_pdf_icon\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"language\":\"\",\"keyref\":\"\",\"readmore\":\"\"}',4,0,4,'','',1,27,'{\"robots\":\"\",\"author\":\"\"}',0,'*',''),(147,267,'Loving Life','loving-life','','<p class=\"MsoNormal\"><!--[if gte mso 9]><xml> <w:WordDocument> <w:View>Normal</w:View> <w:Zoom>0</w:Zoom> <w:TrackMoves /> <w:TrackFormatting /> <w:PunctuationKerning /> <w:ValidateAgainstSchemas /> <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid> <w:IgnoreMi