mphasis\" /> <w:LsdException Locked=\"false\" Priority=\"21\" SemiHidden=\"false\"    UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Emphasis\" /> <w:LsdException Locked=\"false\" Priority=\"31\" SemiHidden=\"false\"    UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Reference\" /> <w:LsdException Locked=\"false\" Priority=\"32\" SemiHidden=\"false\"    UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Reference\" /> <w:LsdException Locked=\"false\" Priority=\"33\" SemiHidden=\"false\"    UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Book Title\" /> <w:LsdException Locked=\"false\" Priority=\"37\" Name=\"Bibliography\" /> <w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\" /> </w:LatentStyles> </xml><![endif]--> <!--[if gte mso 10]> <mce:style><!   /* Style Definitions */  table.MsoNormalTable 	{mso-style-name:\"Table Normal\"; 	mso-tstyle-rowband-size:0; 	mso-tstyle-colband-size:0; 	mso-style-noshow:yes; 	mso-style-priority:99; 	mso-style-qformat:yes; 	mso-style-parent:\"\"; 	mso-padding-alt:0in 5.4pt 0in 5.4pt; 	mso-para-margin:0in; 	mso-para-margin-bottom:.0001pt; 	mso-pagination:widow-orphan; 	font-size:11.0pt; 	font-family:\"Calibri\",\"sans-serif\"; 	mso-ascii-font-family:Calibri; 	mso-ascii-theme-font:minor-latin; 	mso-fareast-font-family:\"Times New Roman\"; 	mso-fareast-theme-font:minor-fareast; 	mso-hansi-font-family:Calibri; 	mso-hansi-theme-font:minor-latin; 	mso-bidi-font-family:\"Times New Roman\"; 	mso-bidi-theme-font:minor-bidi;} --> <!--[endif]--><span style=\"font-size: 11pt; font-family: &quot;Calibri&quot;,&quot;sans-serif&quot;;\">Sometimes people come into your life <br /> and you know right away that they were meant to be there...<br /> to serve some sort of purpose, <br /> teach you a lesson or help figure out <br /> who you are or who you want to become. <br /> <br /> You never know who these people may be but when you look<br /> eyes with them, you know that every moment that you are with them,<br /> they will affect your life in some profound way. And sometimes things happen to<br /> you at the time that may seem horrible, painful and unfair, but in reflection<br /> you realize that without overcoming those obstacles you would have never<br /> realized your potential, strength, will power or heart.<br /> <br /> Everything happens for a reason!<br /> Nothing happens by chance or by means of good luck. <br /> Illness, injury, love, lost moments of true greatness and sheer<br /> stupidity all occur to test the limits of your soul. <br /> Without these small tests, life would be like a smoothly<br /> paved, straight, flat road to nowhere,<br /> safe and comfortable but dull and utterly pointless.<br /> <br /> The people you meet affect your life.<br /> The successes and downfalls that you<br /> experience can create who you are, and<br /> the bad experiences can be learned<br /> from.... In fact, they are probably the<br /> most poignant and important ones.<br /> <br /> If someone hurts you, betrays you or breaks your heart, forgive them because<br /> they have helped you learn about trust and the importance of being cautious<br /> to whom you open your heart. <br /> <br /> If someone loves you, love them back unconditionally<br /> not only because they love you, but also because they are teaching you to<br /> love and open your heart and eyes to little things.<br /> <br /> MAKE EVERYDAY COUNT! Appreciate every moment and take from it everything<br /> that you possibly can, for you may never be able to experience it again. <br /> Talk to people who you have never talked to before, and actually listen. <br /> Let yourself fall in love, even if it doesn\'t seem right because you are too young or too far, just follow your heart. Surround yourself with those who make you smile, laugh, and make you happy.<br /> <br /> Break free and set your sights high. Hold your head up because you have every right to. Tell yourself you are a great individual and believe in yourself, for if you don\'t believe in yourself, no one else will believe in you. Create your own life then LET GO and LIVE IT! <br /> <br /> <br /> Author unknown </span></p>','',1,87,0,103,'2010-02-08 04:37:29',42,'','2013-03-11 04:17:54',42,0,'0000-00-00 00:00:00','2010-02-08 04:37:29','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_section\":\"\",\"link_section\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_vote\":\"\",\"show_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_pdf_icon\":0,\"show_print_icon\":0,\"show_email_icon\":0,\"language\":\"\",\"keyref\":\"\",\"readmore\":\"\"}',4,0,6,'','',1,29,'{\"robots\":\"\",\"author\":\"\"}',0,'*',''),(149,269,'Commitment','commitment','','<p class=\"MsoNormal\"><span style=\"color: black;\">Bagaimana Kau mendefinisikan KOMITMEN?</span></p>\n<p class=\"MsoNormal\"><span style=\"color: black;\"> </span></p>\n<p class=\"MsoNormal\"><span style=\"color: black;\">Pada Tahun 1939, seorang laki-laki dua puluh tahun dari New York City bernama Jonas Salk menyelesaikan studi di Fakultas kedokteran NYU. Di fakultas itu, ia mulai mempelajari imunologi, termasuk penelitian influenza. Dan selama tahun kedua di fak kedokteran, ia mendapat peluang untuk melakukan penelitian dan mengajar selama satu tahun, ia mengambil kesempatan itu. “Di akhir tahun itu,” ingatnya, “Saya diberitahu bahwa kalau mau, saya bisa pindah dan mendapat gelar Ph.D dibidang biokimia. Tapi pilihan saya adalah tetap menekuni kedokteran. Saya yakin bahwa ini semua terkait dengan ambisi awal, atau hasrat saya sesungguhnya, yaitu memberikan bantuan bagi kemanusiaan, katakanlah, dalam cakupan yang lebih besar daripada sekadar menolong orang per orang saja..”.</span></p>\n<p class=\"MsoNormal\"><span style=\"color: black;\">Pada tahun 1947, Salk menjadi kepala laboratorium penelitian virus di Universitas Pittsburgh, di mana ia mulai meneliti virus polio. Pada masa itu, polio adalah penyakit mengerikan yang setiap tahun melumpuhkan dan merenggut nyawa ribuan orang, dengan anak-anak sebagai korban terbanyak. Epidemi polio di New York pada musim panas 1916 mengakibatkan 27000 orang lumpuh dan 9000 orang lainnya meninggal. Setelah tahun itu, epidemic menjadi lumrah, dan setiap musim panas orang berbondong-bondong ke kota-kota besar, mencoba melindungi anak-anak mereka.</span></p>\n<p class=\"MsoNormal\"><span style=\"color: black;\">Setelah bekerja terus-menerus selama lebihd ari empat tahun, Salk dan timnya menemukan vaksin polio, Yang penting adalah yakin akan apa yang anda kerjakan, ditambah komitmen total pada hal itu. Di musim panas 1952, Jonas Salk menyuntikkan vaksin pada para relawan sehat. Termasuk dalam kelompok itu adalah dirinya sendiri, istri dan ketiga putranya.</span></p>\n<p class=\"MsoNormal\"><span style=\"color: black;\">Komitmen Salk membuahkan hasil. Uji coba vaksin tersebut sukses, dan pada tahun 1955 ia dan mantan pembimbingnya, Thomas francis, bekerja untuk mengimunisasikan 4 juta anak. Selama tahun 1955, dilaporkan ada 28,985 kasus polio di Amerika Serikat. Pada tahun 1956, jumlah itu terpangkas setengahnya. Di tahun 1957, hanya ada 5894 kasus. Hari ini, berkat kerja keras Jonas Salk dan usaha yang diteruskan oleh ilmuwan lain seperti Albert Sabin, Kasus polio di Amerika serikat akhirnya tidak ada lagi.</span></p>\n<p class=\"MsoNormal\"><span style=\"color: black;\">Jonas Salk mengabdikan delapan tahun hidupnya untuk mengalahkan polio. Namun hasrat sejatinya adalah menolong orang, yang ia perlihatkan lebih jauh dengan tidak pernah mempatenkan vaksin ciptaannya. Dengan begitu, vaksin tersebut dapat dipakai menolong orang di seluruh dunia. Anda dapat mengatakan bahwa tim yang paling ia curahi komitmen adalah kemanusiaan itu sendiri.</span></p>\n<p class=\"MsoNormal\"><span style=\"color: black;\"> </span></p>\n<p class=\"MsoNormal\"><span style=\"color: black;\">*Dari THE 17 Essential Qualities of a Team Player</span></p>\n<p> </p>','',1,87,0,103,'2010-02-02 04:55:56',42,'','2013-03-11 04:17:54',42,0,'0000-00-00 00:00:00','2010-02-02 04:55:56','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_section\":\"\",\"link_section\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_vote\":\"\",\"show_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_pdf_icon\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"language\":\"\",\"keyref\":\"\",\"readmore\":\"\"}',4,0,7,'','',1,27,'{\"robots\":\"\",\"author\":\"\"}',0,'*',''),(150,270,'Don\'t Quit','dont-quit','','<p>Please enjoy the video.. ^_^</p>\n<p> </p>\n<p>{mp4}dont_quit{/mp4}</p>','',1,87,0,103,'2010-02-02 03:57:44',42,'','2013-03-11 04:17:54',42,0,'0000-00-00 00:00:00','2010-02-02 03:57:44','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_section\":\"\",\"link_section\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_vote\":\"\",\"show_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_pdf_icon\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"language\":\"\",\"keyref\":\"\",\"readmore\":\"\"}',9,0,8,'','',1,46,'{\"robots\":\"\",\"author\":\"\"}',0,'*',''),(151,273,'Research & Development','oracle-university','','<p>Hi Phinconners,</p>\n<p> </p>\n<p>Here all the bulletin for Research &amp; Development.</p>\n<ul>\n<li><a href=\"index.php?option=com_content&amp;view=article&amp;catid=1:latest-news&amp;id=67:cdp\">CDP</a></li>\n<li>Oracle University</li>\n</ul>\n<p> </p>\n<p>cheers,</p>','',-2,89,0,90,'2010-02-02 04:37:23',42,'','2010-02-10 03:48:22',42,0,'0000-00-00 00:00:00','2010-02-03 04:37:23','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_section\":\"\",\"link_section\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_vote\":\"\",\"show_author\":\"\",\"show_create_date\":\"\",\"show_modify_