,'{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_section\":\"\",\"link_section\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_vote\":\"\",\"show_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_pdf_icon\":0,\"show_print_icon\":0,\"show_email_icon\":0,\"language\":\"\",\"keyref\":\"\",\"readmore\":\"\"}',18,0,2,'','',1,108,'{\"robots\":\"\",\"author\":\"\"}',0,'*',''),(160,284,'Phincon is..','phincon-is','','<div id=\"intro\">\r\n<p><strong style=\"font-family: Lato, Arial, sans-serif; font-size: 24px; line-height: 20.99431800842285px; color: #000000;\">PhinCon Is :</strong> </p>\r\n<p style=\"line-height: 20.99431800842285px; margin: 0px 0px 12px; color: #808080; font-family: Lato, Arial, sans-serif; font-size: 13.63636302947998px;\">PhinCon (Phintraco Consulting), a company member of Phintraco Group, is an Information Technology (IT) consulting and services company. Established in 2001, we are focusing on providing customers with all spectrums of Customer Relationship Management (CRM) solutions and Middleware solutions. Our vision is to become a preferred business partner for CRM and Middleware Solutions in Indonesia and we are developing our scope to Asia Pacific region.</p>\r\n<p style=\"line-height: 20.99431800842285px; margin: 0px 0px 12px; color: #808080; font-family: Lato, Arial, sans-serif; font-size: 13.63636302947998px;\">We draw on the knowledge and experienced individuals, whose skills span the initial generation of ideas, insights and solutions all the way through to detailed implementation.</p>\r\n<p style=\"line-height: 20.99431800842285px; margin: 0px 0px 12px; color: #808080; font-family: Lato, Arial, sans-serif; font-size: 13.63636302947998px;\">With deep industry and business process expertise, broad resources and a proven track record, we mobilize the right people, skills, and technologies to help clients improve their performance</p>\r\n</div>\r\n<p><strong style=\"font-family: Lato, Arial, sans-serif; font-size: 13.63636302947998px; line-height: 20.99431800842285px; color: #000000;\">Our Vision and Mission :</strong> </p>\r\n<p><strong>Vision</strong>: <span style=\"color: #808080; font-family: Lato, Arial, sans-serif; font-size: 14px; line-height: 20.984375px;\">To be a preferred business partner for CRM and middleware solution in Indonesia and next in Asia Pasific</span></p>\r\n<p><strong>Mission</strong>: <span style=\"color: #808080; font-family: Lato, Arial, sans-serif; font-size: 14px; line-height: 20.984375px;\">Build a mutually benefiting partnership with its customers, its employees &amp; stakeholders</span></p>\r\n<p><span style=\"color: #808080; font-family: Lato, Arial, sans-serif; font-size: 14px; line-height: 20.984375px;\"> </span></p>\r\n<hr />\r\n<p><strong style=\"font-family: Lato, Arial, sans-serif; font-size: 22px; line-height: 20.99431800842285px; color: #000000;\">SPICE is Our Values:</strong></p>\r\n<ul style=\"line-height: 20.99431800842285px; margin: 0px 0px 0px 20px; list-style-position: outside; list-style-image: none; padding: 0px; font-family: Lato, Arial, sans-serif; font-size: 13.63636302947998px;\">\r\n<li style=\"font-size: 12px; line-height: 20px; color: #808080; margin-bottom: 10px;\"><strong style=\"color: #000;\">Strong team work</strong><br />Never doubt that a small group of thoughtful, Committed people can changes the world. Indeed, it is the Only thing that ever has.</li>\r\n<li style=\"font-size: 12px; line-height: 20px; color: #808080; margin-bottom: 10px;\"><strong style=\"color: #000;\">Professionalism<br /></strong>Willing to achieve with high quality and high dedication, responsible, enthusiasm and commitment to clients</li>\r\n<li style=\"font-size: 12px; line-height: 20px; color: #808080; margin-bottom: 10px;\"><strong style=\"color: #000;\">Integrity<br /></strong>Reliable and honest to clients aiming to become a trustworthy partner</li>\r\n<li style=\"font-size: 12px; line-height: 20px; color: #808080; margin-bottom: 10px;\"><strong style=\"color: #000;\">Constant initiative</strong><br />Always able to take necessary leading action or step to get the job done well</li>\r\n<li style=\"font-size: 12px; line-height: 20px; color: #808080; margin-bottom: 10px;\"><strong style=\"color: #000;\">Exceeding customer expectations</strong><br />Knowing and understanding customer’s needs and giving more beyond their intention and hope</li>\r\n</ul>','',1,91,0,105,'2008-08-11 00:42:31',42,'','2013-03-20 08:01:07',42,0,'0000-00-00 00:00:00','2006-10-10 06:00:00','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"0\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"0\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"0\",\"show_modify_date\":\"0\",\"show_publish_date\":\"0\",\"show_item_navigation\":\"0\",\"show_icons\":\"0\",\"show_print_icon\":\"0\",\"show_email_icon\":\"0\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',27,0,3,'','',1,651,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(161,287,'Employee Excellent','employee-excellent','','<p>Hi phinconers,</p>\n<p>Employee excellent 2011</p>\n<p><img src=\"pic/employee excellent.jpg\" border=\"0\" width=\"523\" height=\"358\" /></p>\n<p>Cheers,....</p>','',1,93,0,100,'2011-05-20 08:02:48',42,'','2013-03-11 04:22:05