t;;\">Dear Mas Yusi &amp; Keluarga, </span></p>\n<p class=\"MsoNormal\"><span style=\"font-size: 18pt; font-family: &quot;Brush Script MT&quot;;\"> </span></p>\n<p class=\"MsoNormal\"><span style=\"font-size: 18pt; font-family: &quot;Brush Script MT&quot;;\">Selamat atas kelahiran Ananda tercinta..<strong> </strong></span></p>\n<p class=\"MsoNormal\"><span style=\"font-size: 18pt; font-family: &quot;Brush Script MT&quot;;\">Semoga kelak menjadi ananda yang soleh..</span></p>\n<p><span style=\"font-size: 18pt; font-family: &quot;Brush Script MT&quot;;\">Berbakti kepada kedua orang tua serta menjadi ananda yang berguna untuk Bangsa dan Agamanya. Amin</span></p>\n<p> </p>','',0,93,0,100,'2010-05-03 10:51:16',42,'','2013-03-11 04:24:11',42,0,'0000-00-00 00:00:00','2010-05-03 10:51:16','2010-05-07 17:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_section\":\"\",\"link_section\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_vote\":\"\",\"show_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_pdf_icon\":0,\"show_print_icon\":0,\"show_email_icon\":0,\"language\":\"\",\"keyref\":\"\",\"readmore\":\"\"}',3,0,21,'','',1,0,'{\"robots\":\"\",\"author\":\"\"}',0,'*',''),(185,313,'SPICE Pesta Gol, CDP Kurang Pemain','spice-pesta-gol-cdp-kurang-pemain','','<p class=\"MsoNormal\" style=\"text-align: left;\"><strong>SPICE Pesta Gol, CDP Kurang Pemain</strong></p>\n<p class=\"MsoNormal\" style=\"text-align: left;\"><strong>JAKARTA, Phincon.com</strong></p>\n<p>Tim sepakbola Spice akhirnya menipiskan harapan CDP untuk merebut gelar juara Champion.</p>\n<p>Pada pertandingan awal, Spice mengalahkan CDP dengan skor telak 5-2. CDP yang kekurangan personil, terlihat tidak berdaya menghadapi Spice.</p>\n<p><strong>Jalannya Pertandingan</strong></p>\n<p>Pada babak Pertama, CDP yang diperkuat antara lain oleh Reyno Torres, Budi Ronaldo, Deny Benzema, Indrawan Ronaldo dan kiper pinjaman Ajie Van Der Sar cukup berhasil mengimbangi Spice yang diperkuat oleh Johnson Tevez, Mokhta Vidic, Sopyan Adebayour, AW Rooney, Surya Fletcher dan Adam Guerrero. Namun memasuki babak ke-2, CDP terlihat cukup kewalahan mengimbangi permainan Spice. Apalagi dengan banyaknya blunder yang dilakukan penjaga gawang CDP.</p>\n<p>Sepanjang babak kedua, City cuma menambah satu gol melalui Reyno Torres dimenit ke-71. CDP kemudian mampu memperpendek jarak menjadi 5-2, berkat gol Deny Benzema. Skor tersebut bertahan sampai akhir laga.</p>\n<p>Pertandingan berikutnya akan di adakan <strong>9 April 2010 (Jumat)</strong> dan disiarkan langsung dari <strong>Kickspot Futsal</strong> mulai jam <strong>21.00</strong>.</p>\n<p>Agar tidak sampai dipermalukan lagi, maka tim CDP harus turun dengan kekuatan full.</p>\n<p><span style=\"font-size: 12pt;\"> </span></p>\n<p class=\"MsoNormal\" style=\"text-align: left;\"><span style=\"font-size: 12pt;\"> </span></p>\n<p class=\"MsoNormal\" style=\"text-align: left;\"><span style=\"font-size: 12pt;\"> </span></p>\n<p style=\"text-align: left;\"><span style=\"font-size: 12pt;\"><br /></span></p>\n<p><span style=\"font-size: 12pt;\"><img src=\"pic/Futsal1.jpg\" border=\"0\" width=\"489\" height=\"327\" style=\"vertical-align: middle;\" /></span></p>\n<p>Tim Phincon</p>\n<p><span style=\"font-size: 12pt;\"><img src=\"pic/Futsal2.jpg\" border=\"0\" width=\"480\" height=\"352\" style=\"vertical-align: middle;\" /></span></p>\n<p>Practice Make Perfect</p>\n<p><span style=\"font-size: 12pt;\"><img src=\"pic/Futsal3.jpg\" border=\"0\" width=\"252\" height=\"377\" style=\"vertical-align: middle;\" /></span></p>\n<p>Cute Supporter<span style=\"font-size: 12pt;\"> </span></p>\n<p> </p>\n<p>cheers,</p>\n<p><span style=\"font-size: 12pt;\"> </span><input id=\"gwProxy\" type=\"hidden\" /><input id=\"jsProxy\" onclick=\"jsCall();\" type=\"hidden\" /></p>\n<p><input id=\"gwProxy\" type=\"hidden\" /><input id=\"jsProxy\" onclick=\"jsCall();\" type=\"hidden\" /></p>\n<p><input id=\"gwProxy\" type=\"hidden\" /><input id=\"jsProxy\" onclick=\"jsCall();\" type=\"hidden\" /></p>\n<p><input id=\"gwProxy\" type=\"hidden\" /><input id=\"jsProxy\" onclick=\"jsCall();\" type=\"hidden\" /></p>\n<p><input id=\"gwProxy\" type=\"hidden\" /><input id=\"jsProxy\" onclick=\"jsCall();\" type=\"hidden\" /></p>','',0,93,0,100,'2010-04-06 03:07:12',42,'','2013-03-11 04:24:11',42,0,'0000-00-00 00:00:00','2010-04-06 03:07:12','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_section\":\"\",\"link_section\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_vote\":\"\",\"show_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_pdf_icon\":0,\"show_print_icon\":0,\"show_email_icon\":0,\"language\":\"\",\"keyref\":\"\",\"readmore\":\"\"}',5,0,22,'','',1,3,'{\"robots\":\"\",\"author\":\"\"}',0,'*',''),(186,314,'PhinCon\'s Party February 2010','phinconsparty','','<p>Hi Phinconners,</p>\n<p>This is our Valentine and Imlek\' Day party 2010 at 16<sup>th </sup>floor The East Building, Mega Kuningan.</p>\n<p> </p>\n<p>Please enjoy the <a href=\"DOCS/PhinconParty022010.pptx\" target=\"_blank\" title=\"documentation\">documentation</a>.</p>\n<p> </p>\n<p>cheers,</p>\n<p><input id=\"gwProxy\" type=\"hidden\" /><input id=\"jsProxy\" onclick=\"jsCall();\" type=\"hidden\" /></p>\n<p><input id=\"gwProxy\" type=\"hidden\" /><input id=\"jsProxy\" onclick=\"jsCall();\" type=\"hidden\" /></p>\n<p><input id=\"gwProxy\" type=\"hidden\" /><input id=\"jsProxy\" onclick=\"jsCall();\" type=\"hidden\" /></p>','',0,93,0,100,'2010-03-08 04:42:50',42,'','2013-03-11 04:24:11',42,0,'0000-00-00 00:00:00','2010-03-08 04:42:50','0000-00-00 00:00:00','','','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_section\":\"\",\"link_section\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_vote\":\"\",\"show_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_pdf_icon\":\"\",\"show_print_icon\":\"\",\