t 3\" />SemiHidden=\"false\" UnhideWhenUsed=\"false\" Name=\"Medium Grid 2 Accent 4\" />UnhideWhenUsed=\"false\" Name=\"Colorful Grid Accent 6\" />Section1 {size:8.5in 11.0in; margin:1.0in 1.0in 1.0in 1.0in; mso-header-margin:.5in; mso-footer-margin:.5in; mso-paper-source:0;} div.Section1 {page:Section1;} --> Dear Phinconers, We’d like to share a Great News… A beautiful baby boy has come from one of our Friend-Mas Yusi at RS. Bunda Alia-Pondok Bambu (Room No.: 401) on May 2 nd , 2010 at 10.00pm. Please join us to welcoming his new Baby boy…\";s:9:\"published\";N;s:5:\"state\";i:1;s:6:\"access\";s:1:\"1\";s:8:\"language\";s:1:\"*\";s:18:\"publish_start_date\";s:19:\"2010-05-03 10:51:16\";s:16:\"publish_end_date\";s:19:\"2010-05-07 17:00:00\";s:10:\"start_date\";s:19:\"2010-05-03 10:51:16\";s:8:\"end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"list_price\";N;s:10:\"sale_price\";N;s:7:\"type_id\";i:1;}'),(48,'index.php?option=com_k2&view=item&id=367','index.php?option=com_k2&view=item&id=367:spice-pesta-gol-cdp-kurang-pemain&Itemid=584','SPICE Pesta Gol, CDP Kurang Pemain','SPICE Pesta Gol, CDP Kurang Pemain JAKARTA, Phincon.com Tim sepakbola Spice akhirnya menipiskan harapan CDP untuk merebut gelar juara Champion. Pada pertandingan awal, Spice mengalahkan CDP dengan skor telak 5-2. CDP yang kekurangan personil, terlihat tid','2013-03-13 12:14:06','bb521b38a05d7b28e3cbc8fab8fc6ebf',1,1,1,'*','2010-04-06 03:07:12','0000-00-00 00:00:00','2010-04-06 03:07:12','0000-00-00 00:00:00',0,0,1,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:25:{s:2:\"id\";s:3:\"367\";s:5:\"alias\";s:33:\"spice-pesta-gol-cdp-kurang-pemain\";s:7:\"summary\";s:942:\"<p class=\"MsoNormal\" style=\"text-align: left;\"><strong>SPICE Pesta Gol, CDP Kurang Pemain</strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: left;\"><strong>JAKARTA, Phincon.com</strong></p>\r\n<p>Tim sepakbola Spice akhirnya menipiskan harapan CDP untuk merebut gelar juara Champion.</p>\r\n<p>Pada pertandingan awal, Spice mengalahkan CDP dengan skor telak 5-2. CDP yang kekurangan personil, terlihat tidak berdaya menghadapi Spice.</p>\r\n<p><strong>Jalannya Pertandingan</strong></p>\r\n<p>Pada babak Pertama, CDP yang diperkuat antara lain oleh Reyno Torres, Budi Ronaldo, Deny Benzema, Indrawan Ronaldo dan kiper pinjaman Ajie Van Der Sar cukup berhasil mengimbangi Spice yang diperkuat oleh Johnson Tevez, Mokhta Vidic, Sopyan Adebayour, AW Rooney, Surya Fletcher dan Adam Guerrero. Namun memasuki babak ke-2, CDP terlihat cukup kewalahan mengimbangi permainan Spice. Apalagi dengan banyaknya blunder yang dilakukan penjaga gawang CDP.</p>\r\n\";s:4:\"body\";s:1729:\"\r\n<p> </p>\r\n<p>Sepanjang babak kedua, City cuma menambah satu gol melalui Reyno Torres dimenit ke-71. CDP kemudian mampu memperpendek jarak menjadi 5-2, berkat gol Deny Benzema. Skor tersebut bertahan sampai akhir laga.</p>\r\n<p>Pertandingan berikutnya akan di adakan <strong>9 April 2010 (Jumat)</strong> dan disiarkan langsung dari <strong>Kickspot Futsal</strong> mulai jam <strong>21.00</strong>.</p>\r\n<p>Agar tidak sampai dipermalukan lagi, maka tim CDP harus turun dengan kekuatan full.</p>\r\n<p> </p>\r\n<p class=\"MsoNormal\" style=\"text-align: left;\"> </p>\r\n<p class=\"MsoNormal\" style=\"text-align: left;\"> </p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 12pt;\"> </span></p>\r\n<p><span style=\"font-size: 12pt;\"><img src=\"pic/Futsal1.jpg\" border=\"0\" width=\"489\" height=\"327\" style=\"vertical-align: middle;\" /></span></p>\r\n<p>Tim Phincon</p>\r\n<p><span style=\"font-size: 12pt;\"><img src=\"pic/Futsal2.jpg\" border=\"0\" width=\"480\" height=\"352\" style=\"vertical-align: middle;\" /></span></p>\r\n<p>Practice Make Perfect</p>\r\n<p><span style=\"font-size: 12pt;\"><img src=\"pic/Futsal3.jpg\" border=\"0\" width=\"252\" height=\"377\" style=\"vertical-align: middle;\" /></span></p>\r\n<p>Cute Supporter</p>\r\n<p> </p>\r\n<p>cheers,</p>\r\n<p><input id=\"gwProxy\" type=\"hidden\" /><input id=\"jsProxy\" onclick=\"jsCall();\" type=\"hidden\" /></p>\r\n<p><input id=\"gwProxy\" type=\"hidden\" /><input id=\"jsProxy\" onclick=\"jsCall();\" type=\"hidden\" /></p>\r\n<p><input id=\"gwProxy\" type=\"hidden\" /><input id=\"jsProxy\" onclick=\"jsCall();\" type=\"hidden\" /></p>\r\n<p><input id=\"gwProxy\" type=\"hidden\" /><input id=\"jsProxy\" onclick=\"jsCall();\" type=\"hidden\" /></p>\r\n<p><input id=\"gwProxy\" type=\"hidden\" /><input id=\"jsProxy\" onclick=\"jsCall();\" type=\"hidden\" /></p>\";s:5:\"catid\";s:3:\"105\";s:10:\"created_by\";s:2:\"42\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"2013-03-13 05:14:06\";s:11:\"modified_by\";s:2:\"42\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":136:{s:10:\"enable_css\";s:1:\"1\";s:14:\"jQueryHandling\";s:9:\"1.7remote\";s:21:\"backendJQueryHandling\";s:6:\"remote\";s:8:\"userName\";s:1:\"1\";s:9:\"userImage\";s:1:\"1\";s:15:\"userDescription\";s:1:\"1\";s:7:\"userURL\";s:1:\"1\";s:9:\"userEmail\";s:1:\"0\";s:12:\"userFeedLink\";s:1:\"0\";s:12:\"userFeedIcon\";s:1:\"0\";s:13:\"userItemCount\";s:1:\"4\";s:13:\"userItemTitle\";s:1:\"1\";s:19:\"userItemTitleLinked\";s:1:\"1\";s:19:\"userItemDateCreated\";s:1:\"1\";s:13:\"userItemImage\";s:1:\"1\";s:17:\"userItemIntroText\";s:1:\"1\";s:16:\"userItemCategory\";s:1:\"1\";s:12:\"userItemTags\";s:1:\"1\";s:22:\"userItemCommentsAnchor\";s:1:\"1\";s:16:\"userItemReadMore\";s:1:\"1\";s:17:\"userItemK2Plugins\";s:1:\"1\";s:18:\"defaultUsersItemid\";s:3:\"539\";s:12:\"tagItemCount\";s:1:\"4\";s:12:\"tagItemTitle\";s:1:\"1\";s:18:\"tagItemTitleLinked\";s:1:\"1\";s:18:\"tagItemDateCreated\";s:1:\"1\";s:12:\"tagItemImage\";s:1:\"1\";s:16:\"tagItemIntroText\";s:1:\"1\";s:15:\"tagItemCategory\";s:1:\"1\";s:15:\"tagItemReadMore\";s:1:\"1\";s:18:\"tagItemExtraFields\";s:1:\"0\";s:11:\"tagOrdering\";s:0:\"\";s:11:\"tagFeedLink\";s:1:\"1\";s:11:\"tagFeedIcon\";s:1:\"1\";s:17:\"defaultTagsItemid\";s:3:\"540\";s:16:\"genericItemC