ew=item&id=367:spice-pesta-gol-cdp-kurang-pemain&Itemid=584\";s:5:\"title\";s:34:\"SPICE Pesta Gol, CDP Kurang Pemain\";s:11:\"description\";s:754:\"SPICE Pesta Gol, CDP Kurang Pemain JAKARTA, Phincon.com Tim sepakbola Spice akhirnya menipiskan harapan CDP untuk merebut gelar juara Champion. Pada pertandingan awal, Spice mengalahkan CDP dengan skor telak 5-2. CDP yang kekurangan personil, terlihat tidak berdaya menghadapi Spice. Jalannya Pertandingan Pada babak Pertama, CDP yang diperkuat antara lain oleh Reyno Torres, Budi Ronaldo, Deny Benzema, Indrawan Ronaldo dan kiper pinjaman Ajie Van Der Sar cukup berhasil mengimbangi Spice yang diperkuat oleh Johnson Tevez, Mokhta Vidic, Sopyan Adebayour, AW Rooney, Surya Fletcher dan Adam Guerrero. Namun memasuki babak ke-2, CDP terlihat cukup kewalahan mengimbangi permainan Spice. Apalagi dengan banyaknya blunder yang dilakukan penjaga gawang CDP.\";s:9:\"published\";N;s:5:\"state\";i:1;s:6:\"access\";s:1:\"1\";s:8:\"language\";s:1:\"*\";s:18:\"publish_start_date\";s:19:\"2010-04-06 03:07:12\";s:16:\"publish_end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"start_date\";s:19:\"2010-04-06 03:07:12\";s:8:\"end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"list_price\";N;s:10:\"sale_price\";N;s:7:\"type_id\";i:1;}'),(49,'index.php?option=com_k2&view=item&id=368','index.php?option=com_k2&view=item&id=368:phincons-party-february-2010&Itemid=584','PhinCon\'s Party February 2010','Hi Phinconners, This is our Valentine and Imlek\' Day party 2010 at 16 th floor The East Building, Mega Kuningan. Please enjoy the documentation . cheers,','2013-03-13 17:19:15','a8e823093ce8487a48f27d2b054d0e8a',1,1,1,'*','2010-03-08 04:42:50','0000-00-00 00:00:00','2010-03-08 04:42:50','0000-00-00 00:00:00',0,0,1,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:25:{s:2:\"id\";s:3:\"368\";s:5:\"alias\";s:28:\"phincons-party-february-2010\";s:7:\"summary\";s:591:\"<p>Hi Phinconners,</p>\n<p>This is our Valentine and Imlek\' Day party 2010 at 16<sup>