,'0000-00-00 00:00:00',0,0,1,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:25:{s:2:\"id\";s:3:\"370\";s:5:\"alias\";s:22:\"phincon-internal-event\";s:7:\"summary\";s:1585:\"<p class=\"MsoNormal\"><span style=\"font-family: \'Century Schoolbook\',\'serif\';\">Hi all!</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: \'Century Schoolbook\',\'serif\';\">Apa kabar semua? Sibuk pastinya?! </span><span style=\"font-family: Wingdings;\">J</span><span style=\"font-family: \'Century Schoolbook\',\'serif\';\">.....kabar baik…kabar baik!....kita mau bikin acara kumpul-kumpul niih!....banyak yang bisa kita rayakan dan syukuri dipertemuan ini…</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: \'Century Schoolbook\',\'serif\';\">..</span><span style=\"font-size: 14pt; font-family: \'Century Schoolbook\',\'serif\';\">Lunar New Year</span><span style=\"font-family: \'Century Schoolbook\',\'serif\';\">, </span><span style=\"font-size: 14pt; font-family: \'Century Schoolbook\',\'serif\';\">Valentine</span><span style=\"font-family: \'Century Schoolbook\',\'serif\';\"> *<strong>woot..woot</strong>*, </span><span style=\"font-size: 14pt; font-family: \'Century Schoolbook\',\'serif\';\">ulang tahun</span><span style=\"font-family: \'Century Schoolbook\',\'serif\';\"> (sponsooooor!!), </span><span style=\"font-size: 14pt; font-family: \'Century Schoolbook\',\'serif\';\">kepulangan temen-temen dari India</span><span style=\"font-family: \'Century Schoolbook\',\'serif\';\"> (siap-siap cerita ya tim India</span><span style=\"font-family: Wingdings;\">J</span><span style=\"font-family: \'Century Schoolbook\',\'serif\';\"> ) dan </span><span style=\"font-size: 14pt; font-family: \'Century Schoolbook\',\'serif\';\">perkenalan teman-teman CDP</span><span style=\"font-family: \'Century Schoolbook\',\'serif\';\">….</span></p>\r\n\";s:4:\"body\";s:2211:\"\r\n<p class=\"MsoNormal\"> </p>\r\n<p class=\"MsoNormal\"> </p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: \'Century Schoolbook\',\'serif\';\">Seperti tahun lalu kita akan makan-makan dan bagi-bagi <strong>Angpao</strong>…..yipppieeee!!!...pluuss! tukar kado yuuuk (akhir tahun kemarin kan belum sempat…)</span></p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: \'Century Schoolbook\',\'serif\';\">Tanggal pasti sedang dipilih oleh management (I will keep U posted..)……rencananya akan digelar <strong>hari Jum’at after office</strong>…..di Head Quarter, The East lantai 16!</span></p>\r\n<p class=\"MsoNormal\"> </p>\r\n<p class=\"MsoNormal\"><span style=\"font-family: \'Century Schoolbook\',\'serif\';\">Nggak ada salahnya, kalau sempat beli kado dulu… </span><span style=\"font-family: Wingdings;\">J</span></p>\r\n<p class=\"MsoNormal\"> </p>\r\n<p class=\"MsoNormal\"><strong><span style=\"text-decoration: underline;\"><span style=\"font-family: \'Century Schoolbook\',\'serif\';\">Term and condition untuk tukar kado:</span></span></strong></p>\r\n<ol style=\"margin-top: 0in;\" type=\"1\">\r\n<li class=\"MsoNormal\"><span style=\"font-family: \'Century Schoolbook\',\'serif\';\" lang=\"IT\">Harga min. 26 ribu, lebiiih boleeeh!</span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-family: \'Century Schoolbook\',\'serif\';\" lang=\"IT\">Hadiah nggak boleh makanan</span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-family: \'Century Schoolbook\',\'serif\';\">Sebaiknya tidak ber-size (misal: kaos/baju, sandal/sepatu)</span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-family: \'Century Schoolbook\',\'serif\';\">Tidak mengandung pornografi…(hihi apaa siih!...males urusan sama FPI)</span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-family: \'Century Schoolbook\',\'serif\';\">Dibungkus dengan kertas Koran</span></li>\r\n<li class=\"MsoNormal\"><span style=\"font-family: \'Century Schoolbook\',\'serif\';\">Dikumpulkan ke panitia maks. 1 hari sebelum acara</span></li>\r\n</ol>\r\n<p class=\"MsoNormal\"> </p>\r\n<p><span style=\"font-size: 12pt; font-family: \'Century Schoolbook\',\'serif\';\">ok my beloved phinconners….mohon partisipasinya yah…..kritik dan saran boleh dikirimkan langsung ke Ade!....terima kasih banyaaaaaaak dan sampai ketemuuuu!!</span></p>\r\n<p> </p>\";s:5:\"catid\";s:3:\"105\";s:10:\"created_by\";s:2:\"42\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"2013-03-13 05:13:38\";s:11:\"modified_by\";s:2:\"42\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":136:{s:10:\"enable_css\";s:1:\"1\";s:14:\"jQueryHandling\";s:9:\"1.7remote\";s:21:\"backendJQueryHandling\";s:6:\"remote\";s:8:\"userName\";s:1:\"1\";s:9:\"userImage\";s:1:\"1\";s:15:\"userDescription\";s:1:\"1\";s:7:\"userURL\";s:1:\"1\";s:9:\"userEmail\";s:1:\"0\";s:12:\"userFeedLink\";s:1:\"0\";s:12:\"userFeedIcon\";s:1:\"0\";s:13:\"userItemCount\";s:1:\"4\";s:13:\"userItemTitle\";s:1:\"1\";s:19:\"userItemTitleLinked\";s:1:\"1\";s:19:\"userItemDateCreated\";s:1:\"1\";s:13:\"userItemImage\";s:1:\"1\";s:17:\"userItemIntroText\";s:1:\"1\";s:16:\"userItemCategory\";s:1:\"1\";s:12:\"userItemTags\";s:1:\"1\";s:22:\"userItemCommentsAnchor\";s:1:\"1\";s:16:\"userItemReadMore\";s:1:\"1\";s:17:\"userItemK2Plugins\";s:1:\"1\";s:18:\"defaultUsersItemid\";s:3:\"539\";s:12:\"tagItemCount\";s:1:\"4\";s:12:\"tagItemTitle\";s:1:\"1\";s:18:\"tagItemTitleLinked\";s:1:\"1\";s:18:\"tagItemDateCreated\";s:1:\"1\";s:12:\"tagItemImage\";s:1:\"1\";s:16:\"tagItemIntroText\";s:1:\"1\";s:15:\"tagItemCategory\";s:1:\"1\";s:15:\"tagItemReadMore\";s:1:\"1\";s:18:\"tagItemExtraFields\";s:1:\"0\";s:11:\"tagOrdering\";s:0:\"\";s:11:\"tagFeedLink\";s:1:\"1\";s:11:\"tagFeedIcon\";s:1:\"1\";s:17:\"defaultTagsItemid\";s:3:\"540\";s:16:\"genericItemCount\";s:2:\"10\";s:16:\"genericItemTitle\";s:1:\"1\";s:22:\"genericItemTitleLinked\";s:1:\"1\";s:22:\"genericItemDateCreated\";s:1:\"1\";s:16:\"genericItemImage\";s:1:\"1\";s:20:\"genericItemIntroText\";s:1:\"1\";s:19:\"genericItemCategory\";s:1:\"1\";s:19:\"genericItemReadMore\";s:1:\"1\";s:2