9f3ee2',1,0,1,'*','2004-07-06 22:00:00','0000-00-00 00:00:00','2007-07-07 09:54:06','0000-00-00 00:00:00',0,0,1,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:25:{s:2:\"id\";s:3:\"380\";s:5:\"alias\";s:21:\"phincon-berbagi-kasih\";s:7:\"summary\";s:788:\"<p>Berbagi Kasih Panti Werdha \"BEREA\"</p>\n<p><img src=\"pic/berea1.jpg\" border=\"0\" width=\"256\" height=\"200\" style=\"border: 0;\" /></p>\n<p style=\"text-align: left;\">Setiap umat Kristiani pada umumnya senantiasa bergembira setiap menginjak bulan Desember. Ada kegembiraan, rasa syukur, suka cita bahkan menjadi momen spesial yang sayang sekali kalau berlalu begitu saja. Awalnya ide untuk berbagi kasih ini hanya ide personal saja. Muncul keinginan untuk mengajak rekan‐rekan di Phincon agar dapat mengambil bagian untuk Berbagi Kasih maka ide inipun disampaikan pada saat meeting dengan rekan‐rekan di Team On Demand.</p>\n<p style=\"text-align: left;\"><a href=\"DOCS/Berbagi Kasih 11 Des 09.pdf\" target=\"_blank\" title=\"&lt;&lt;read more&gt;&gt;\">&lt;&lt;read more&gt;&gt;</a></p>\n<p> </p>\";s:4:\"body\";s:0:\"\";s:5:\"catid\";s:3:\"105\";s:10:\"created_by\";s:2:\"42\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"2013-03-11 04:22:05\";s:11:\"modified_by\";s:2:\"42\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":136:{s:10:\"enable_css\";s:1:\"1\";s:14:\"jQueryHandling\";s:9:\"1.7remote\";s:21:\"backendJQueryHandling\";s:6:\"remote\";s:8:\"userName\";s:1:\"1\";s:9:\"userImage\";s:1:\"1\";s:15:\"userDescription\";s:1:\"1\";s:7:\"userURL\";s:1:\"1\";s:9:\"userEmail\";s:1:\"0\";s:12:\"userFeedLink\";s:1:\"0\";s:12:\"userFeedIcon\";s:1:\"0\";s:13:\"userItemCount\";s:1:\"4\";s:13:\"userItemTitle\";s:1:\"1\";s:19:\"userItemTitleLinked\";s:1:\"1\";s:19:\"userItemDateCreated\";s:1:\"1\";s:13:\"userItemImage\";s:1:\"1\";s:17:\"userItemIntroText\";s:1:\"1\";s:16:\"userItemCategory\";s:1:\"1\";s:12:\"userItemTags\";s:1:\"1\";s:22:\"userItemCommentsAnchor\";s:1:\"1\";s:1