ot;Arial&quot;,&quot;sans-serif&quot;;\">resources both within and beyond the firewall and enabling paperless user approval process. </span></p>\n<p class=\"MsoNormal\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\">The project will be held in PaninBank Office, Jl. Sudirman, Senayan, Jakarta, starting today, </span></p>\n<p class=\"MsoNormal\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\"><strong>June 1, 2010 – August 18<sup>th</sup></strong> 2010 (phase I).</span></p>\n<p class=\"MsoNormal\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\"><br /></span></p>\n<p class=\"MsoNormal\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\"><span> </span></span></p>\n<p class=\"MsoNormal\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\">Let’s us pray this project will run smooth, and be ready for the next project </span></p>\n<p class=\"MsoNormal\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\"><br /></span></p>\n<p class=\"MsoNormal\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\"> </span></p>\n<p class=\"MsoNormal\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\"> </span></p>\n<p class=\"MsoNormal\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\">Ade,</span></p>\n<p class=\"MsoNormal\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\">The Happy and Proud PhinCon Member</span></p>\";s:4:\"body\";s:0:\"\";s:5:\"catid\";s:3:\"104\";s:10:\"created_by\";s:2:\"42\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"2013-03-11 04:23:22\";s:11:\"modified_by\";s:2:\"42\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":136:{s:10:\"enable_css\";s:1:\"1\";s:14:\"jQueryHandling\";s:9:\"1.7remote\";s:21:\"backendJQueryHandling\";s:6:\"remote\";s:8:\"userName\";s:1:\"1\";s:9:\"userImage\";s:1:\"1\";s:15:\"userDescription\";s:1:\"1\"