5:\"title\";s:24:\"Six Pillars of Character\";s:11:\"description\";s:7:\"cheers,\";s:9:\"published\";N;s:5:\"state\";i:1;s:6:\"access\";s:1:\"1\";s:8:\"language\";s:1:\"*\";s:18:\"publish_start_date\";s:19:\"2010-08-20 03:27:50\";s:16:\"publish_end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"start_date\";s:19:\"2010-08-20 03:27:50\";s:8:\"end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"list_price\";N;s:10:\"sale_price\";N;s:7:\"type_id\";i:1;}'),(70,'index.php?option=com_k2&view=item&id=383','index.php?option=com_k2&view=item&id=383:pria-dibalik-cermin&Itemid=560','Pria Dibalik Cermin','Ketika Anda dapatkan apa yang Anda inginkan dalam perjuangan Anda demi uang, dan dunia menjadikan Anda Raja sehari, bercerminlah, dan lihatlah apa kata pantulan diri Anda. Sebab bukan penilaian Ayah atau Ibu atau Isteri Anda yang harus Anda penuhi. Orang ','2013-03-13 11:35:00','2e903a26154515c539e04895656aec63',1,1,1,'*','2010-05-31 07:17:03','0000-00-00 00:00:00','2010-05-31 07:17:03','0000-00-00 00:00:00',0,0,1,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:25:{s:2:\"id\";s:3:\"383\";s:5:\"alias\";s:19:\"pria-dibalik-cermin\";s:7:\"summary\";s:981:\"<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"> </p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">Ketika Anda dapatkan apa yang Anda inginkan dalam perjuangan Anda demi uang,</p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">dan dunia menjadikan Anda Raja sehari,</p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">bercerminlah, dan lihatlah apa kata pantulan diri Anda.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"> </p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">Sebab bukan penilaian Ayah atau Ibu atau Isteri Anda yang harus Anda penuhi.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">Orang yang penilaiannya paling relevan dalam kehidupan Anda adalah</p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">Justru pantulan diri Anda sendiri.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"> </p>\r\n\";s:4:\"body\";s:2075:\"\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"> </p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">Dialah yang harus anda senangkan, lupakanlah yang lain</p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">Sebab dialah yang akan menyertai Anda sampai akhir, dan</p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">Anda akan melewati ujian yang paling sulit, paling berbahaya,</p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">Kalau pantulan diri Anda itu menjadi sahabat Anda.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"> </p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">Mungkin Anda seperti Jack Horner dan “memahat” sebuah korma,</p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">dan mengganggap diri Anda itu mengagumkan,</p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">tetapi pantulan diri Anda itu mengatakan  Anda payah</p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">kalau tidak berani menatap langsung ke matanya.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"> </p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">Anda boleh saja mengecoh seluruh dunia selama bertahun-tahun,</p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">dan mendapatkan dukungan,</p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">tetapi imbalan akhir Anda hanyalah sakit hati dan airmata,</p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">kalau anda menipu pantulan diri Anda.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\"> </p>\r\n<p class=\"MsoListParagraph\" style=\"text-align: center; text-indent: -0.25in;\" align=\"center\"><!--[if !supportLists]--><span><span>-</span></span><!--[endif]-->Dale WimBrow -</p>\r\n<p class=\"MsoListParagraph\"> </p>\r\n<p class=\"MsoNormal\" style=\"text-align: center;\" align=\"center\">(From The Right To Lead – John C. Maxwell)</p>\r\n<p> </p>\";s:5:\"catid\";s:3:\"108\";s:10:\"created_by\";s:2:\"42\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"2013-03-13 04:34:59\";s:11:\"modified_by\";s:2:\"42\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":136:{s:10:\"enable_css\";s:1:\"1\";s:14:\"jQueryHandling\";s:9:\"1.7remote\";s:21:\"backendJQueryHandling\";s:6:\"remote\";s:8:\"userName\";s:1:\"1\";s:9:\"userImage\";s:1:\"1\";s:15:\"userDescription\";s:1:\"1\";s:7:\"userURL\";s:1:\"1\";s:9:\"userEmail\";s:1:\"0\";s:12:\"userFeedLink\";s:1:\"0\";s:12:\"userFeedIcon\";s:1:\"0\";s:13:\"userItemCount\";s:1:\"4\";s:13:\"userItemTitle\";s:1:\"1\";s:19:\"userItemTitleLinked\";s:1:\"1\";s:19:\"userItemDateCreated\";s:1:\"1\";s:13:\"userItemImage\";s:1:\"1\";s:17:\"userItemIntroText\";s:1:\"1\";s:16:\"userItemCategory\";s:1:\"1\";s:12:\"userItemTags\";s:1:\"1\";s:22:\"userItemCommentsAnchor\";s:1:\"1\";s:16:\"userItemReadMore\";s:1:\"1\";s:17:\"userItemK2Plugins\";s:1:\"1\";s:18:\"defaultUsersItemid\";s:3:\"539\";s:12:\"tagItemCount\";s:1:\"4\";s:12:\"tagItemTitle\";s:1:\"1\";s:18:\"tagItemTitleLinked\";s:1:\"1\";s:18:\"tagItemDateCreated\";s:1:\"1\";s:12:\"tagItemImage\";s:1:\"1\";s:16:\"tagItemIntroText\";s:1:\"1\";s:15:\"tagItemCategory\";s:1:\"1\";s:15:\"tagItemReadMore\";s:1:\"1\";s:18:\"tagItemExtraFields\";s:1:\"0\";s:11:\"tagOrdering\";s:0:\"\";s:11:\"tagFeedLink\";s:1:\"1\";s:11:\"tagFeedIcon\";s:1:\"1\";s:17:\"defaultTagsItemid\";s:3:\"540\";s:16:\"genericItemCount\";s:2:\"10\";s:16:\"genericItemTitle\";s:1:\"1\";s:22:\"genericItem