ption\";s:350:\"Ketika Anda dapatkan apa yang Anda inginkan dalam perjuangan Anda demi uang, dan dunia menjadikan Anda Raja sehari, bercerminlah, dan lihatlah apa kata pantulan diri Anda. Sebab bukan penilaian Ayah atau Ibu atau Isteri Anda yang harus Anda penuhi. Orang yang penilaiannya paling relevan dalam kehidupan Anda adalah Justru pantulan diri Anda sendiri.\";s:9:\"published\";N;s:5:\"state\";i:1;s:6:\"access\";s:1:\"1\";s:8:\"language\";s:1:\"*\";s:18:\"publish_start_date\";s:19:\"2010-05-31 07:17:03\";s:16:\"publish_end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"start_date\";s:19:\"2010-05-31 07:17:03\";s:8:\"end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"list_price\";N;s:10:\"sale_price\";N;s:7:\"type_id\";i:1;}'),(71,'index.php?option=com_k2&view=item&id=384','index.php?option=com_k2&view=item&id=384:extend-your-neck&Itemid=560','Extend Your Neck','Tom McConnell, president of New England Securities Cooperation, published the following guiding principles to liberate his employees from the fear or trying new things: Take risks. Don’t play it save Make mistakes. Don’t try to avoid them Take initiative.','2013-03-13 11:34:13','a3230ace7c15b2f588b4d21ba46db12a',1,1,1,'*','2010-04-14 10:11:54','0000-00-00 00:00:00','2010-04-14 10:11:54','0000-00-00 00:00:00',0,0,1,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:25:{s:2:\"id\";s:3:\"384\";s:5:\"alias\";s:16:\"extend-your-neck\";s:7:\"summary\";s:494:\"<p class=\"MsoNormal\">Tom McConnell, president of New England Securities Cooperation, published the following guiding principles to liberate his employees from the fear or trying new things:</p>\r\n<p class=\"MsoNormal\"> </p>\r\n<ol>\r\n<li>Take risks. Don’t play it save</li>\r\n<li><!--[endif]-->Make mistakes. Don’t try to avoid them</li>\r\n<li>Take initiative. Don’t wait for instruction</li>\r\n<li>Spend energy on solutions not emotions</li>\r\n<li>Shoot for total quality. Don’t save standards\";s:4:\"body\";s:1096:\"</li>\r\n<li>Welcome destruction