yle-colband-size:0;      mso-style-noshow:yes;   mso-style-priority:99;  mso-style-qformat:yes;  mso-style-parent:\"\";    mso-padding-alt:0in 5.4pt 0in 5.4pt;    mso-para-margin:0in;    mso-para-margin-bottom:.0001pt;         mso-pagination:widow-orphan;    font-size:11.0pt;       font-family:\"Calibri\",\"sans-serif\";     mso-ascii-font-family:Calibri;  mso-ascii-theme-font:minor-latin;       mso-fareast-font-family:\"Times New Roman\";      mso-fareast-theme-font:minor-fareast;   mso-hansi-font-family:Calibri;  mso-hansi-theme-font:minor-latin;       mso-bidi-font-family:\"Times New Roman\";         mso-bidi-theme-font:minor-bidi;} --> <!--[endif]-->One day a father and his rich family took his son to a trip to the country with the firm purpose to show him how poor people can be. They spent a day and a night in the farm of a very poor family. When they got back from their trip the father asked his son, \"How was the trip?\" \"Very good Dad!\" \"Did you see how poor people can be?\" the father asked. \"Yeah!\" \"And what did you learn?\"</p>\r\n<p>The son answered, \"I saw that we have a dog at home, and they have four. We have a pool that reaches to the middle of the garden, they have a creek that has no end. We have imported lamps in the garden, they have the stars.</p>\r\n\";s:4:\"body\";s:613:\"\r\n<p>Our patio reaches to the front yard, they have a whole horizon.\"When the little boy was finishing, his father was speechless.His son added, \"Thanks Dad for showing me how poor we are!\"</p>\r\n<p> </p>\r\n<p><strong>Lessons</strong> : <em>Isn\'t it true that it all depends on the way you look at things? If you have love, friends, family, health, good humor and a positive attitude towards life you\'ve got everything! You can\'t buy any of these things, but still you can have all the material possessions you can imagine, provisions for the future, etc., but if you are poor of spirit, you have nothing!</em></p>\";s:5:\"catid\";s:3:\"108\";s:10:\"created_by\";s:2: