phasis\" /> <w:LsdException Locked=\"false\" Priority=\"31\" SemiHidden=\"false\"    UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Reference\" /> <w:LsdException Locked=\"false\" Priority=\"32\" SemiHidden=\"false\"    UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Reference\" /> <w:LsdException Locked=\"false\" Priority=\"33\" SemiHidden=\"false\"    UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Book Title\" /> <w:LsdException Locked=\"false\" Priority=\"37\" Name=\"Bibliography\" /> <w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\" /> </w:LatentStyles> </xml><![endif]--><!--  /* Font Definitions */  @font-face 	{font-family:\"Cambria Math\"; 	panose-1:2 4 5 3 5 4 6 3 2 4; 	mso-font-charset:1; 	mso-generic-font-family:roman; 	mso-font-format:other; 	mso-font-pitch:variable; 	mso-font-signature:0 0 0 0 0 0;} @font-face 	{font-family:Calibri; 	panose-1:2 15 5 2 2 2 4 3 2 4; 	mso-font-charset:0; 	mso-generic-font-family:swiss; 	mso-font-pitch:variable; 	mso-font-signature:-1610611985 1073750139 0 0 159 0;}  /* Style Definitions */  p.MsoNormal, li.MsoNormal, div.MsoNormal 	{mso-style-unhide:no; 	mso-style-qformat:yes; 	mso-style-parent:\"\"; 	margin:0in; 	margin-bottom:.0001pt; 	mso-pagination:widow-orphan; 	font-size:11.0pt; 	font-family:\"Calibri\",\"sans-serif\"; 	mso-fareast-font-family:Calibri; 	mso-fareast-theme-font:minor-latin; 	mso-bidi-font-family:\"Times New Roman\";} .MsoChpDefault 	{mso-style-type:export-only; 	mso-default-props:yes; 	font-size:10.0pt; 	mso-ansi-font-size:10.0pt; 	mso-bidi-font-size:10.0pt;} @page Section1 	{size:8.5in 11.0in; 	margin:1.0in 1.0in 1.0in 1.0in; 	mso-header-margin:.5in; 	mso-footer-margin:.5in; 	mso-paper-source:0;} div.Section1 	{page:Section1;} --><!--[if gte mso 10]> <mce:style><!   /* Style Definitions */  table.MsoNormalTable 	{mso-style-name:\"Table Normal\"; 	mso-tstyle-rowband-size:0; 	mso-tstyle-colband-size:0; 	mso-style-noshow:yes; 	mso-style-priority:99; 	mso-style-qformat:yes; 	mso-style-parent:\"\"; 	mso-padding-alt:0in 5.4pt 0in 5.4pt; 	mso-para-margin:0in; 	mso-para-margin-bottom:.0001pt; 	mso-pagination:widow-orphan; 	font-size:11.0pt; 	font-family:\"Calibri\",\"sans-serif\"; 	mso-ascii-font-family:Calibri; 	mso-ascii-theme-font:minor-latin; 	mso-fareast-font-family:\"Times New Roman\"; 	mso-fareast-theme-font:minor-fareast; 	mso-hansi-font-family:Calibri; 	mso-hansi-theme-font:minor-latin; 	mso-bidi-font-family:\"Times New Roman\"; 	mso-bidi-theme-font:minor-bidi;} --> <!--[endif]--><strong>Loving Life </strong></p>\r\n<p class=\"MsoNormal\"><strong> </strong></p>\r\n<p><span style=\"font-size: 11pt; font-family: \'Calibri\',\'sans-serif\';\">Loving life means trying to live a fulfilled life. But doing so can be difficult without having a positive mindset. For many people, it can be pretty hard to enjoy living a life full of problems and worries. But even in a situation such as this, life can be enjoyed by having a positive state of mind.<br /> <br /> Having a positive attitude can help a person appreciate life more. It is looking into the good things in life more rather than its bad side. Having a positive mindset can help a person stay focused on what it needs to love life and enjoy it. Building up a positive mindset is not as difficult as others may think.</span></p>\r\n\";s:4:\"body\";s:2944:\"\r\n<p><span style=\"font-size: 11pt; font-family: \'Calibri\',\'sans-serif\';\"><br /> <br /> One of the important things to remember in life is that the way we think can influence greatly the way we act. By thinking always on the positive, we are reinforcing out attitude to focus on what good life has to offer. There are other ways that a positive mindset can be practiced on a daily basis. It is simply a matter of trying it out.<br /> <br /> One way of creating a positive state of mind is by simply appreciating having a life. Some people may tend to forget that life itself is short of miraculous. Just the daily functions that life goes through tend to be overlooked most of the time. But in the seemingly ordinary and common activities such as walking, talking and having the ability to see can many of the wonders be exhibited.<br /> <br /> Just imagine if you cannot walk anymore, talk to someone or see the beauty that is all around you. What if you suddenly find yourself not being able to do what you normally do? Many people only realize that what they have is valuable only after losing them. So why not appreciate life in general and the many things that you can still do and thank the high heavens for it. Now that would help you start putting on a more positive outlook in life- learning to appreciate what you have and are blessed with.<br /> <br /> Another way of trying to develop a positive mindset is by trying to focus on the simple things in life. Life can be so simple and enjoyed more if people only learn to be content. But because some people strive for something more, complications ensue. Along with the complications problems and certain issues may come up. Over time, these things build up and would likely end up as a big burden that will prevent people from eventually loving and enjoying life.<br /> <br /> By just focusing on the simple things in life, you try to avoid making life a little more complicated. And along the way, you try to avoid worrying about life the more you think about it. Worrying won\'t get you anywhere, only deeper into a hole that you may be building for yourself. The more you worry, the deeper the hole gets and the harder it will take to get out from it.<br /> <br /> Another way to develop a positive mindset in life is to share what you feel to others all around you. You may not be aware of it, but loving and enjoying life can be contagious. If you have a positive mindset, try to share it with others by helping them think positively for a change. Just by looking at how good you feel about loving life, they might also wish follow your example.<br /> <br /> Helping people develop positive mindset will not only be helping them love and enjoy life but also be a good way to reinforce your own zest for life. Surrounding yourself with people with a positive outlook makes it easier for you to maintain the habit day in and day out.<br /> <br /> Ads by Google</span></p>\r\n<p> </p>\";s:5:\"catid\";s:3:\"108\";s:10:\"created_by\";s:2:\"42\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"2013-03-13 04:45:14\";s:11:\"modified_by\";s:2:\"42\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":136:{s:10:\"enable_css\";s:1:\"1\";s:14:\"jQueryHandling\";s:9:\"1.7remote\";s:21:\"backendJQueryHandling\";s:6:\"remote\";s:8:\"userName\";s:1:\"1\";s:9:\"userImage\";s:1:\"1\";s:15:\"userDescription\";s:1:\"1\";s:7:\"userURL\";s:1:\"1\";s:9:\"userEmail\";s:1:\"0\";s:12:\"userFeedLink\";s:1:\"0\";s:12:\"userFeedIcon\";s:1:\"0\";s:13:\"userItemCount\";s:1:\"4\";s:13:\"userItemTitle\";s:1:\"1\";s:19:\"userItemTitleLinked\";s:1:\"1\";s:19:\"userItemDateCreated\";s:1:\"1\";s:13:\"userItemImage\";s:1:\"1\";s:17:\"userItemIntroText\";s:1:\"1\";s:16:\"userItemCategory\";s:1:\"1\";s:12:\"userItemTags\";s:1:\"1\";s:22:\"userItemCommentsAnchor\";s:1:\"1\";s:16:\"userItemReadMore\";s:1:\"1\";s:17:\"userItemK2Plugins\";s:1:\"1\";s:18:\"defaultUsersItemid\";s:3:\"539\";s:12:\"tagItemCount\";s:1:\"4\";s:12:\"tagItemTitle\";s:1:\"1\";s:18:\"tagItemTitleLinked\";s:1:\"1\";s:18:\"tagItemDateCreated\";s:1:\"1\";s:12:\"tagItemImage\";s:1:\"1\";s:16:\"tagItemIntroText\";s:1:\"1\";s:15:\"tagItemCategory\";s:1:\"1\";s:15:\"tagItemReadMore\";s:1:\"1\";s:18:\"tagItemExtraFields\";s:1:\"0\";s:11:\"tagOrdering\";s:0:\"\";s:11:\"tagFeedLink\";s:1:\"1\";s:11:\"tagFeedIcon\";s:1:\"1\";s:17:\"defaultTagsItemid\";s:3:\"540\";s:16:\"genericItemCount\";s:2:\"10\";s:16:\"genericItemTitle\";s:1:\"1\";s:22:\"genericItemTitleLinked\";s:1:\"1\";s:22:\"genericItemDateCreated\";s:1:\"1\";s:16:\"genericItemImage\";s:1:\"1\";s:20:\"genericIte