\"Colorful List Accent 6\" /> <w:LsdException Locked=\"false\" Priority=\"73\" SemiHidden=\"false\"    UnhideWhenUsed=\"false\" Name=\"Colorful Grid Accent 6\" /> <w:LsdException Locked=\"false\" Priority=\"19\" SemiHidden=\"false\"    UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Emphasis\" /> <w:LsdException Locked=\"false\" Priority=\"21\" SemiHidden=\"false\"    UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Emphasis\" /> <w:LsdException Locked=\"false\" Priority=\"31\" SemiHidden=\"false\"    UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Subtle Reference\" /> <w:LsdException Locked=\"false\" Priority=\"32\" SemiHidden=\"false\"    UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Intense Reference\" /> <w:LsdException Locked=\"false\" Priority=\"33\" SemiHidden=\"false\"    UnhideWhenUsed=\"false\" QFormat=\"true\" Name=\"Book Title\" /> <w:LsdException Locked=\"false\" Priority=\"37\" Name=\"Bibliography\" /> <w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\" /> </w:LatentStyles> </xml><![endif]--> <!--[if gte mso 10]> <mce:style><!   /* Style Definitions */  table.MsoNormalTable 	{mso-style-name:\"Table Normal\"; 	mso-tstyle-rowband-size:0; 	mso-tstyle-colband-size:0; 	mso-style-noshow:yes; 	mso-style-priority:99; 	mso-style-qformat:yes; 	mso-style-parent:\"\"; 	mso-padding-alt:0in 5.4pt 0in 5.4pt; 	mso-para-margin:0in; 	mso-para-margin-bottom:.0001pt; 	mso-pagination:widow-orphan; 	font-size:11.0pt; 	font-family:\"Calibri\",\"sans-serif\"; 	mso-ascii-font-family:Calibri; 	mso-ascii-theme-font:minor-latin; 	mso-fareast-font-family:\"Times New Roman\"; 	mso-fareast-theme-font:minor-fareast; 	mso-hansi-font-family:Calibri; 	mso-hansi-theme-font:minor-latin; 	mso-bidi-font-family:\"Times New Roman\"; 	mso-bidi-theme-font:minor-bidi;} --> <!--[endif]--><span style=\"font-size: 11pt; font-family: \'Calibri\',\'sans-serif\';\">Sometimes people come into your life <br /> and you know right away that they were meant to be there...<br /> to serve some sort of purpose, <br /> teach you a lesson or help figure out <br /> who you are or who you want to become. <br /> <br /> You never know who these people may be but when you look<br /> eyes with them, you know that every moment that you are with them,<br /> they will affect your life in some profound way. And sometimes things happen to<br /> you at the time that may seem horrible, painful and unfair, but in reflection<br /> you realize that without overcoming those obstacles you would have never<br /> realized your potential, strength, will power or heart.</span></p>\r\n\";s:4:\"body\";s:1932:\"\r\n<p><span style=\"font-size: 11pt; font-family: \'Calibri\',\'sans-serif\';\"><br /> <br /> Everything happens for a reason!<br /> Nothing happens by chance or by means of good luck. <br /> Illness, injury, love, lost moments of true greatness and sheer<br /> stupidity all occur to test the limits of your soul. <br /> Without these small tests, life would be like a smoothly<br /> paved, straight, flat road to nowhere,<br /> safe and comfortable but dull and utterly pointless.<br /> <br /> The people you meet affect your life.<br /> The successes and downfalls that you<br /> experience can create who you are, and<br /> the bad experiences can be learned<br /> from.... In fact, they are probably the<br /> most poignant and important ones.<br /> <br /> If someone hurts you, betrays you or breaks your heart, forgive them because<br /> they have helped you learn about trust and the importance of being cautious<br /> to whom you open your heart. <br /> <br /> If someone loves you, love them back unconditionally<br /> not only because they love you, but also because they are teaching you to<br /> love and open your heart and eyes to little things.<br /> <br /> MAKE EVERYDAY COUNT! Appreciate every moment and take from it everything<br /> that you possibly can, for you may never be able to experience it again. <br /> Talk to people who you have never talked to before, and actually listen. <br /> Let yourself fall in love, even if it doesn\'t seem right because you are too young or too far, just follow your heart. Surround yourself with those who make you smile, laugh, and make you happy.<br /> <br /> Break free and set your sights high. Hold your head up because you have every right to. Tell yourself you are a great individual and believe in yourself, for if you don\'t believe in yourself, no one else will believe in you. Create your own life then LET GO and LIVE IT! <br /> <br /> <br /> Author unknown </span></p>\";s:5:\"catid\";s:3:\"108\";s:10:\"created_by\";s:2:\"42\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"2013-03-13 04:46:08\";s:11:\"modified_by\";s:2:\"42\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":137:{s:10:\"enable_css\";s:1:\"1\";s:14:\"jQueryHandling\";s:9:\"1.7remote\";s:21:\"backendJQueryHandling\";s:6:\"remote\";s:8:\"userName\";s:1:\"1\";s:9:\"userImage\";s:1:\"1\";s:15:\"userDescription\";s:1:\"1\";s:7:\"userURL\";s:1:\"1\";s:9:\"userEmail\";s:1:\"0\";s:12:\"userFeedLink\";s:1:\"0\";s:12:\"userFeedIcon\";s:1:\"0\";s:13:\"userItemCount\";s:1:\"4\";s:13:\"userItemTitle\";s:1:\"1\";s:19:\"userItemTitleLinked\";s:1:\"1\";s:19:\"userItemDateCreated\";s:1:\"1\";s:13:\"userItemImage\";s:1:\"1\";s:17:\"userItemIntroText\";s:1:\"1\";s:16:\"userItemCategory\";s:1:\"1\";s:12:\"userItemTags\";s:1:\"1\";s:22:\"userItemCommentsAnchor\";s:1:\"1\";s:16:\"userItemReadMore\";s:1:\"1\";s:17:\"userItemK2Plugins\";s:1:\"1\";s:18:\"defaultUsersItemid\";s:3:\"539\";s:12:\"tagItemCount\";s:1:\"4\";s:12:\"tagItemTitle\";s:1:\"1\";s:18:\"tagItemTitleLinked\";s:1:\"1\";s:18:\"tagItemDateCreated\";s:1:\"1\";s:12:\"tagItemImage\";s:1:\"1\";s:16:\"tagItemIntroText\";s:1:\"1\";s:15:\"tagItemCategory\";s:1:\"1\";s:15:\"tagItemReadMore\";s:1:\"1\";s:18:\"tagItemExtraFields\";s:1:\"0\";s:11:\"tagOrdering\";s:0:\"\";s:11:\"tagFeedLink\";s:1:\"1\";s:11:\"tagFeedIcon\";s:1: