lieve that this will c','2013-03-13 11:23:38','42566744d2594fa16e38276bc558d32a',1,1,1,'*','2006-10-10 06:00:00','0000-00-00 00:00:00','2008-08-11 00:42:31','0000-00-00 00:00:00',0,0,1,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:25:{s:2:\"id\";s:3:\"393\";s:5:\"alias\";s:10:\"phincon-is\";s:7:\"summary\";s:1474:\"<div id=\"intro\">\r\n<p>For over 18 years, as a group of companies, Phintraco has been supporting and providing its customers with world-class leading edge solutions. Deliver solutions and services that help customers accelerate their business growth. We believe that this will create significant new value, to our customers and PhinCon as well.</p>\r\n<p>Today, Phintraco Group has served over 300 customers, ranging from medium to large companies, local and multi-national companies, both in Indonesia and overseas market.</p>\r\n</div>\r\n<p>Phintraco Consulting (PhinCon), a member of Phintraco Group, is an Information Technology (IT) consulting and services company, specializing in Customer Relationship Management (CRM) and Middleware solutions as well as related services.</p>\r\n<p>Currently we are recognized as the Oracle Certified Partner in Indonesia for Oracle Siebel CRM and Oracle Fusion Middleware products. We are committed to continue our supports and improve our operations to become more sustainable. With our proven methodology and approach combined with knowledgeable and experienced consultants, we believe that we can bring substantial benefits to our customers.</p>\r\n<p> </p>\r\n<h4>Our Vision and Mission</h4>\r\n<p><strong>Vision</strong>: To be a preferred business partner for CRM solution in Indonesia and next in Asia Pacific</p>\r\n<p><strong>Mission</strong>: Build a mutually benefiting partnership with its customers its employees &amp; stakeholders</p>\";s:4:\"body\";s:0:\"\";s:5:\"catid\";s:3:\"110\";s:10:\"created_by\";s:2:\"42\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"2013-03-13 04:23:38\";s:11:\"modifie