pecializing in Customer Relationship Management (CRM) and Middleware solutions as well as related services. Currently we are recognized as the Oracle Certified Partner in Indonesia for Oracle Siebel CRM and Oracle Fusion Middleware products. We are committed to continue our supports and improve our operations to become more sustainable. With our proven methodology and approach combined with knowledgeable and experienced consultants, we believe that we can bring substantial benefits to our customers. Our Vision and Mission Vision : To be a preferred business partner for CRM solution in Indonesia and next in Asia Pacific Mission : Build a mutually benefiting partnership with its customers its employees & stakeholders\";s:9:\"published\";N;s:5:\"state\";i:1;s:6:\"access\";s:1:\"1\";s:8:\"language\";s:1:\"*\";s:18:\"publish_start_date\";s:19:\"2006-10-10 06:00:00\";s:16:\"publish_end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"start_date\";s:19:\"2008-08-11 00:42:31\";s:8:\"end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"list_price\";N;s:10:\"sale_price\";N;s:7:\"type_id\";i:1;}'),(82,'index.php?option=com_k2&view=item&id=396','index.php?option=com_k2&view=item&id=396:test&Itemid=584','testarticle','testy teste','2013-03-13 17:28:37','947302417e682b50e3210d4ef1a4d6f1',1,1,1,'*','2013-03-13 10:28:09','0000-00-00 00:00:00','2013-03-13 10:28:09','0000-00-00 00:00:00',0,0,1,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:25:{s:2:\"id\";s:3:\"396\";s:5:\"alias\";s:4:\"test\";s:7:\"summary\";s:18:\"<p>testy teste</p>\";s:4:\"body\";s:0:\"\";s:5:\"catid\";s:3:\"105\";s:10:\"created_by\";s:2:\"42\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"0000-00-00 00:00:00\";s:11:\"modified_by\";s:1:\"0\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":136:{s:10:\"enable_css\";s:1:\"1\";s:14:\"jQueryHandling\";s:9:\"1.7remote\";s:21:\"backendJQueryHandling\";s:6:\"remote\";s:8:\"userName\";s:1:\"1\";s:9:\"userImage\";s:1:\"1\";s:15:\"userDescr