'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:25:{s:2:\"id\";s:3:\"397\";s:5:\"alias\";s:10:\"sang-juara\";s:7:\"summary\";s:1048:\"<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Suatu ketika, ada seorang anak yang sedang mengikuti sebuah lomba mobil balap mainan. Suasana sungguh meriah siang itu. Sebab, ini adalah babak final. Hanya tersisa 4 orang sekarang dan mereka memamerkan setiap mobil mainan yang dimiliki. Semuanya buatan sendiri. Sebab, memanh begitulah peraturannya.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Ada seorang anak bernama mark. Mobilnya tak istimewa, namun ia termasuk dalam 4 anak yang masuk final. Dibanding semua lawannya, mobil Mark lah yang paling tak sempurna. Beberapa anak menyangsikan kekuatan mobil itu untuk berpacu melawan mobil lainnya.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Yah, memang, mobil itu tak begitu menarik. Dengan kayu yang sederhana dan sedikit lampu kedip diatasnya, tentu tak sebanding dengan hiasan mewah yang dimiliki mobil mainan lainnya. Namu, Mark bangga dengan itu semua, sebab mobil itu buatan tangannya sendiri.</span></p>\r\n\";s:4:\"body\";s:3869:\"\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"> </p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Tibalah saat yang dinantikan. Final kejuaraan mobil balap mainan. Setiap anak mulai bersiap di garis start, untuk mendorong mobil mereka kencang-kencang. Di setiap jalur lintasan, telah siap 4 mobil dengan 4 ‘pembalap’ kecilnya. Lintasan itu berbentuk lingkaran dengan 4 jalur terpisah diantaranya.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Namun, sesaat kemudian, Mark meminta waktu sebentar sebelum lomba dimulai. Ia tampak berkomat-kamit seperti sedang berdoa. Matanya terpejam dengan tangan yang bertangkup memanjatkan doa. Lalu, smenit kemudian ia berkata, “ya, aku siap!”</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Dor. Tanda telah dimulai. Dengan satu hentakan kuat mereka mulai mendorong mobilnya kuat-kuat. Semua mobil itu pun meluncur dengan cepat. Setiap orang bersorak-sorai, bersemangat menjagokan mobilnya masing-masing. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">“ayo…ayo…cepat, cepat, maju maju”, begitu teriak mereka. Ahha..sang pemenang harus ditentukan.  Tali lintasan finish pun telah terlambai. Dan, Mark lah pemenangnya. Ya, semuannya senang begitu juga Mark. Ia berucap, dan berkomat-kamit lagi dalam hati “terima kasih”</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Saat pembagian piala tiba. Mark maju ke depan dengan bangga. Sebelum piala itu diserahkan. Ketua panitia bertanya “Hai jagoan, kamu pasti tadi berdoa kepada Tuhan agar kamu menang, bukan?”. Mark terdiam. “bukan, pak, bukan itu yang aku panjatkan” kata Mark.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Ia lalu melanjutkan. “sepertinya, tak adil untuk meminta pada Tuhan untuk menolongmu mengalahkan orang lain. “aku, hanya bermohon pada Tuhan, supaya aku tak menangis, jika aku kalah“. semua hadirin terdiam mendengar itu. Setelah beberapa saat, terdengarlah gemuruh tepuk-tangan yang memenuhi ruangan.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Renungan ;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Anak-anak tampaknya lebih punya kebijaksanaan dibanding kita semua. Mark, tidaklah bermohon pada Tuhan untuk menang dalam setiap ujian. Mark, tak memohon Tuhan untuk meluluskan dan mengatur setiap hasil yang ingin diraihnya. Anak itu juga tak meminta Tuhan mengabulkan semua harapannya. Ia tak berdoa untuk menang. Dan menyakiti yang lainnya. Namun, Mark, bermohon pada Tuhan, agar diberikan kekuatan saat menghadapi itu semua. Ia berdoa, agar diberi kemuliaan, dan mau menyadari kekurangan dengan rasa bangga.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Mungkin, telah banyak waktu yang kita lakukan untuk berdoa pada Tuhan untuk mengabulkan setiap permintaan kita. Terlalu sering juga kita meminta Tuhan untuk menjadikan kita nomor satu, menjadi yang terbaik, menjadi pemenang dalam setiap ujian. Terlalu sering kita berdoa pada Tuhan, untuk menghalau setiap halangan dan cobaan yang ada di depan mata. Padahal, bukanlah yang kita butuh adalah bimbingan-Nya, tuntunan-Nya, dan panduan-Nya?</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Kita, sering terlau lemah untuk percaya bahwa kita kuat. Kita sering lupa, dan kita sering cengeng dengan  kehidupan ini. Tak adalah semangat perjuangan yang mau kita lalui?? Saya yakin, Tuhan memeberikan kita ujian yang berat, bukan untuk membuat kita lemah, cengeng dan mudah menyerah. Sesungguhnya, Tuhan sedang menguji setiap hamba-Nya yang shaleh (adapted from irfan-seeds)</span></p>\";s:5:\"catid\";s:3:\"108\";s:10:\"created_by\";s:2:\"44\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"0000-00-00 00:00:00\";s:11:\"modified_by\";s:1:\"0\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":136:{s:10:\"enable_css\";s:1:\"1\";s:14:\"jQueryHandling\";s:9:\"1.7remote\";s:21:\"backendJQueryHandling\";s:6:\"remote\";s:8:\"userName\";s:1:\"1\";s:9:\"userImage\";s:1:\"1\";s:15:\"userDescription\";s:1:\"1\";s:7:\"userURL\";s:1:\"1\";s:9:\"userEmail\";s:1:\"0\";s:12:\"userFeedLink\";s:1:\"0\";s:12:\"userFeedIcon\";s:1:\"0\";s:13:\"userItemCount\";s:1:\"4\";s:13:\"userItemTitle\";s:1:\"1\";s:19:\"userItemTitleLinked\";s:1:\"1\";s:19:\"userItemDateCreated\";s:1:\"1\";s:13:\"userItemImage\";s:1:\"1\";s:17:\"userItemIntroText\";s:1:\"1\";s:16:\"userItemCategory\";s:1:\"1\";s:12:\"us