";i:5;s:10:\"metaauthor\";i:6;s:6:\"author\";i:7;s:16:\"created_by_alias\";}i:4;a:2:{i:0;s:4:\"path\";i:1;s:5:\"alias\";}i:5;a:1:{i:0;s:8:\"comments\";}}s:11:\"\0*\0taxonomy\";a:4:{s:4:\"Type\";a:1:{s:7:\"K2 Item\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:7:\"K2 Item\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}s:6:\"Author\";a:1:{s:4:\"dila\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:4:\"dila\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}s:11:\"K2 Category\";a:1:{s:15:\"Life Motivation\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:15:\"Life Motivation\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}s:8:\"Language\";a:1:{s:1:\"*\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:1:\"*\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}}s:3:\"url\";s:40:\"index.php?option=com_k2&view=item&id=398\";s:5:\"route\";s:62:\"index.php?option=com_k2&view=item&id=398:sang-juara&Itemid=560\";s:5:\"title\";s:10:\"Sang Juara\";s:11:\"description\";s:3804:\"Suatu ketika, ada seorang anak yang sedang mengikuti sebuah lomba mobil balap mainan. Suasana sungguh meriah siang itu. Sebab, ini adalah babak final. Hanya tersisa 4 orang sekarang dan mereka memamerkan setiap mobil mainan yang dimiliki. Semuanya buatan sendiri. Sebab, memanh begitulah peraturannya. Ada seorang anak bernama mark. Mobilnya tak istimewa, namun ia termasuk dalam 4 anak yang masuk final. Dibanding semua lawannya, mobil Mark lah yang paling tak sempurna. Beberapa anak menyangsikan kekuatan mobil itu untuk berpacu melawan mobil lainnya. Yah, memang, mobil itu tak begitu menarik. Dengan kayu yang sederhana dan sedikit lampu kedip diatasnya, tentu tak sebanding dengan hiasan mewah yang dimiliki mobil mainan lainnya. Namu, Mark bangga dengan itu semua, sebab mobil itu buatan tangannya sendiri. Tibalah saat yang dinantikan. Final kejuaraan mobil balap mainan. Setiap anak mulai bersiap di garis start, untuk mendorong mobil mereka kencang-kencang. Di setiap jalur lintasan, telah siap 4 mobil dengan 4 ‘pembalap’ kecilnya. Lintasan itu berbentuk lingkaran dengan 4 jalur terpisah diantaranya. Namun, sesaat kemudian, Mark meminta waktu sebentar sebelum lomba dimulai. Ia tampak berkomat-kamit seperti sedang berdoa. Matanya terpejam dengan tangan yang bertangkup memanjatkan doa. Lalu, smenit kemudian ia berkata, “ya, aku siap!” Dor. Tanda telah dimulai. Dengan satu hentakan kuat mereka mulai mendorong mobilnya kuat-kuat. Semua mobil itu pun meluncur dengan cepat. Setiap orang bersorak-sorai, bersemangat menjagokan mobilnya masing-masing.class=\"MsoNormal\" style=\"text-align: justify;\"> “ayo…ayo…cepat, cepat, maju maju”, begitu teriak mereka. Ahha..sang pemenang harus ditentukan. Tali lintasan finish pun telah terlambai. Dan, Mark lah pemenangnya. Ya, semuannya senang begitu juga Mark. Ia berucap, dan berkomat-kamit lagi dalam hati “terima kasih” Saat pembagian piala tiba. Mark maju ke depan dengan bangga. Sebelum piala itu diserahkan. Ketua panitia bertanya “Hai jagoan, kamu pasti tadi berdoa kepada Tuhan agar kamu menang, bukan?”. Mark terdiam. “bukan, pak, bukan itu yang aku panjatkan” kata Mark. Ia lalu melanjutkan. “sepertinya, tak adil untuk meminta pada Tuhan untuk menolongmu mengalahkan orang lain. “aku, hanya bermohon pada Tuhan, supaya aku tak menangis, jika aku kalah“. semua hadirin terdiam mendengar itu. Setelah beberapa saat, terdengarlah gemuruh tepuk-tangan yang memenuhi ruangan. Renungan ; Anak-anak tampaknya lebih punya kebijaksanaan dibanding kita semua. Mark, tidaklah bermohon pada Tuhan untuk menang dalam setiap ujian. Mark, tak memohon Tuhan untuk meluluskan dan mengatur setiap hasil yang ingin diraihnya. Anak itu juga tak meminta Tuhan mengabulkan semua harapannya. Ia tak berdoa untuk menang. Dan menyakiti yang lainnya. Namun, Mark, bermohon pada Tuhan, agar diberikan kekuatan saat menghadapi itu semua. Ia berdoa, agar diberi kemuliaan, dan mau menyadari kekurangan dengan rasa bangga. Mungkin, telah banyak waktu yang kita lakukan untuk berdoa pada Tuhan untuk mengabulkan setiap permintaan kita. Terlalu sering juga kitameminta Tuhan untuk menjadikan kita nomor satu, menjadi yang terbaik, menjadi pemenang dalam setiap ujian. Terlalu sering kita berdoa pada Tuhan, untuk menghalau setiap halangan dan cobaan yang ada di depan mata. Padahal, bukanlah yang kita butuh adalah bimbingan-Nya, tuntunan-Nya, dan panduan-Nya? Kita, sering terlau lemah untuk percaya bahwa kita kuat. Kita sering lupa, dan kita sering cengeng dengan kehidupan ini. Tak adalah semangat perjuangan yang mau kita lalui?? Saya yakin, Tuhan memeberikan kita ujian yang berat, bukan untuk membuat kita lemah, cengeng dan mudah menyerah. Sesungguhnya, Tuhan sedang menguji setiap hamba-Nya yang shaleh (adapted from irfan-seeds)\";s:9:\"published\";N;s:5:\"state\";i:0;s:6:\"access\";s:1:\"1\";s:8:\"language\";s:1:\"*\";s:18:\"publish_start_date\";s:19:\"2013-03-13 10:50:13\";s:16:\"publish_end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"start_date\";s:19:\"2013-03-13 10:50:13\";s:8:\"end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"list_price\";N;s:10:\"sale_price\";N;s:7:\"type_id\";i:1;}'),(85,'index.php?option=com_k2&view=item&id=399','index.php?option=com_k2&view=item&id=399:sang-juara&Itemid=560','Sang Juara','Suatu ketika, ada seorang anak yang sedang mengikuti sebuah lomba mobil balap mainan. Suasana sungguh meriah siang itu. Sebab, ini adalah babak final. Hanya tersisa 4 orang sekarang dan mereka memamerkan setiap mobil mainan yang dimiliki. Semuanya buatan ','2013-03-13 17:56:05','aa46c81be79188eaa7980ae1baa57968',1,1,1,'*','2013-03-13 10:50:42','0000-00-00 00:00:00','2013-03-13 10:50:42','0000-00-00 00:00:00',0,0,1,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:25:{s:2:\"id\";s:3:\"399\";s:5:\"alias\";s:10:\"sang-juara\";s:7:\"summary\";s:2824:\"<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Suatu ketika, ada seorang anak yang sedang mengikuti sebuah lomba mobil balap mainan. Suasana sungguh meriah siang itu. Sebab, ini adalah babak final. Hanya tersisa 4 orang sekarang dan mereka memamerkan setiap mobil mainan yang dimiliki. Semuanya buatan sendiri. Sebab, memangbegitulah peraturannya.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Ada seorang anak bernama mark. Mobilnya tak istimewa, namun ia termasuk dalam 4 anak yang masuk final. Dibanding semua lawannya, mobil Mark lah yang paling tak sempurna. Beberapa anak menyangsikan kekuatan mobil itu untuk berpacu melawan mobil lainnya.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Yah, memang, mobil itu tak begitu menarik. Dengan kayu yang sederhana dan sedikit lampu kedip diatasnya, tentu tak sebanding dengan hiasan mewah yang dimiliki mobil mainan lainnya. Namun, Mark bangga dengan itu semua, sebab mobil itu buatan tangannya sendiri.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Tibalah saat yang dinantikan. Final kejuaraan mobil balap mainan. Setiap anak mulai bersiap di garis start, untuk mendorong mobil mereka kencang-kencang. Di setiap jalur lintasan, telah siap 4 mobil dengan 4 ‘pembalap’ kecilnya. Lintasan itu berbentuk lingkaran dengan 4 jalur terpisah diantaranya.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Namun, sesaat kemudian, Mark meminta waktu sebentar sebelum lomba dimulai. Ia tampak berkomat-kamit seperti sedang berdoa. Matanya terpejam dengan tangan yang bertangkup memanjatkan doa. Lalu, semenit kemudian ia berkata, “ya, aku siap!”</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Dor. Tanda telah dimulai. Dengan satu hentakan kuat mereka mulai mendorong mobilnya kuat-kuat. Semua mobil itu pun meluncur dengan cepat. Setiap orang bersorak-sorai, bersemangat menjagokan mobilnya masing-masing. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">“ayo…ayo…cepat, cepat, maju maju”, begitu teriak mereka. Ahha..sang pemenang harus ditentukan.  Tali lintasan finish pun telah terlambai. Dan, Mark lah pemenangnya. Ya, semuannya senang begitu juga Mark. Ia berucap, dan berkomat-kamit lagi dalam hati “terima kasih”</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Saat pembagian piala tiba. Mark maju ke depan dengan bangga. Sebelum piala itu diserahkan. Ketua panitia bertanya “Hai jagoan, kamu pasti tadi berdoa kepada Tuhan agar kamu menang, bukan?”. Mark terdiam. “bukan, pak, bukan itu yang aku panjatkan” kata Mark.</span></p>\r\n\";s:4:\"body\";s:2094:\"\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"> </p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Ia lalu melanjutkan. “sepertinya, tak adil untuk meminta pada Tuhan untuk menolongmu mengalahkan orang lain. “aku, hanya bermohon pada Tuhan, supaya aku tak menangis, jika aku kalah“. semua hadirin terdiam mendengar itu. Setelah beberapa saat, terdengarlah gemuruh tepuk-tangan yang memenuhi ruangan.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Renungan ;</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Anak-anak tampaknya lebih punya kebijaksanaan dibanding kita semua. Mark, tidaklah bermohon pada Tuhan untuk menang dalam setiap ujian. Mark, tak memohon Tuhan untuk meluluskan dan mengatur setiap hasil yang ingin diraihnya. Anak itu juga tak meminta Tuhan mengabulkan semua harapannya. Ia tak berdoa untuk menang. Dan menyakiti yang lainnya. Namun, Mark, bermohon pada Tuhan, agar diberikan kekuatan saat menghadapi itu semua. Ia berdoa, agar diberi kemuliaan, dan mau menyadari kekurangan dengan rasa bangga.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Mungkin, telah banyak waktu yang kita lakukan untuk berdoa pada Tuhan untuk mengabulkan setiap permintaan kita. Terlalu sering juga kita meminta Tuhan untuk menjadikan kita nomor satu, menjadi yang terbaik, menjadi pemenang dalam setiap ujian. Terlalu sering kita berdoa pada Tuhan, untuk menghalau setiap halangan dan cobaan yang ada di depan mata. Padahal, bukanlah yang kita butuh adalah bimbingan-Nya, tuntunan-Nya, dan panduan-Nya?</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify;\"><span lang=\"IN\">Kita, sering terlau lemah untuk percaya bahwa kita kuat. Kita sering lupa, dan kita sering cengeng dengan  kehidupan ini. Tak adalah semangat perjuangan yang mau kita lalui?? Saya yakin, Tuhan memeberikan kita ujian yang berat, bukan untuk membuat kita lemah, cengeng dan mudah menyerah. Sesungguhnya, Tuhan sedang menguji setiap hamba-Nya yang shaleh (adapted from irfan-seeds)</span></p>\";s:5:\"catid\";s:3:\"108\";s:10:\"created_by\";s:2:\"44\";s:16:\"created_by_alias\";s:0:\"\";s:8:\"modified\";s:19:\"2013-03-13 10:56:04\";s:11:\"modified_by\";s:2:\"42\";s:6:\"params\";O:9:\"JRegistry\":1:{s:7:\"\0*\0data\";O:8:\"stdClass\":136:{s:10:\"enable_css\";s:1:\"1\";s:14:\"jQueryHandling\";s:9:\"1.7remote\";s:21:\"backendJQueryHandling\";s:6:\"remote\";s:8:\"userName\";s:1:\"1\";s:9:\"userImage\";s:1:\"1\";s:15:\"userDescription\";s:1:\"1\";s:7:\"userURL\";s:1:\"1\";s:9:\"userEmail\";s:1:\"0\";s:12:\"userFeedLink\";s:1:\"0\";s:12:\"userFeedIcon\";s:1:\"0\";s:13:\"userItemCount\";s:1:\"4\";s:13:\"userItemTitle\";s:1:\"1\";s:19:\"userItemTitleLinked\";s:1:\"1\";s:19:\"userItemDateCreated\";s:1:\"1\";s:13:\"userItemImage\";s:1:\"1\";s:17:\"userItemIntroText\";s:1:\"1\";s:16:\"userItemCategory\";s:1:\"1\";s:12:\"userItemTags\";s:1:\"1\";s:22:\"userItemCommentsAnchor\";s:1:\"1\";s:16:\"userItemReadMore\";s:1:\"1\";s:17:\"userItemK2Plugins\";s:1:\"1\";s:18:\"defaultUsersItemid\";s:3:\"539\";s:12:\"tagItemCount\";s:1:\"4\";s:12:\"tagItemTitle\";s:1:\"1\";s:18:\"tagItemTitleLinked\";s:1:\"1\";s:18:\"tagItemDateCreate