:\"access\";i:1;}}s:8:\"Language\";a:1:{s:1:\"*\";O:7:\"JObject\":4:{s:10:\"\0*\0_errors\";a:0:{}s:5:\"title\";s:1:\"*\";s:5:\"state\";i:1;s:6:\"access\";i:1;}}}s:3:\"url\";s:40:\"index.php?option=com_k2&view=item&id=399\";s:5:\"route\";s:62:\"index.php?option=com_k2&view=item&id=399:sang-juara&Itemid=560\";s:5:\"title\";s:10:\"Sang Juara\";s:11:\"description\";s:2162:\"Suatu ketika, ada seorang anak yang sedang mengikuti sebuah lomba mobil balap mainan. Suasana sungguh meriah siang itu. Sebab, ini adalah babak final. Hanya tersisa 4 orang sekarang dan mereka memamerkan setiap mobil mainan yang dimiliki. Semuanya buatan sendiri. Sebab, memangbegitulah peraturannya. Ada seorang anak bernama mark. Mobilnya tak istimewa, namun ia termasuk dalam 4 anak yang masuk final. Dibanding semua lawannya, mobil Mark lah yang paling tak sempurna. Beberapa anak menyangsikan kekuatan mobil itu untuk berpacu melawan mobil lainnya. Yah, memang, mobil itu tak begitu menarik. Dengan kayu yang sederhana dan sedikit lampu kedip diatasnya, tentu tak sebanding dengan hiasan mewah yang dimiliki mobil mainan lainnya. Namun, Mark bangga dengan itu semua, sebab mobil itu buatan tangannya sendiri. Tibalah saat yang dinantikan. Final kejuaraan mobil balap mainan. Setiap anak mulai bersiap di garis start, untuk mendorong mobil mereka kencang-kencang. Di setiap jalur lintasan, telah siap 4 mobil dengan 4 ‘pembalap’ kecilnya. Lintasan itu berbentuk lingkaran dengan 4 jalur terpisah diantaranya. Namun, sesaat kemudian, Mark meminta waktu sebentar sebelum lomba dimulai. Ia tampak berkomat-kamit seperti sedang berdoa. Matanya terpejam dengan tangan yang bertangkup memanjatkan doa. Lalu, semenit kemudian ia berkata, “ya, aku siap!” Dor. Tanda telah dimulai. Dengan satu hentakan kuat mereka mulai mendorong mobilnya kuat-kuat. Semua mobil itu pun meluncur dengan cepat. Setiap orang bersorak-sorai, bersemangat menjagokan mobilnya masing-masing.class=\"MsoNormal\" style=\"text-align: justify;\"> “ayo…ayo…cepat, cepat, maju maju”, begitu teriak mereka. Ahha..sang pemenang harus ditentukan. Tali lintasan finish pun telah terlambai. Dan, Mark lah pemenangnya. Ya, semuannya senang begitu juga Mark. Ia berucap, dan berkomat-kamit lagi dalam hati “terima kasih” Saat pembagian piala tiba. Mark maju ke depan dengan bangga. Sebelum piala itu diserahkan. Ketua panitia bertanya “Hai jagoan, kamu pasti tadi berdoa kepada Tuhan agar kamu menang, bukan?”. Mark terdiam. “bukan, pak, bukan itu yang aku panjatkan” kata Mark.\";s:9:\"published\";N;s:5:\"state\";i:1;s:6:\"access\";s:1:\"1\";s:8:\"language\";s:1:\"*\";s:18:\"publish_start_date\";s:19:\"2013-03-13 10:50:42\";s:16:\"publish_end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"start_date\";s:19:\"2013-03-13 10:50:42\";s:8:\"end_date\";s:19:\"0000-00-00 00:00:00\";s:10:\"list_price\";N;s:10:\"sale_price\";N;s:7:\"type_id\";i:1;}'),(86,'index.php?option=com_k2&view=item&id=391','index.php?option=com_k2&view=item&id=391:phincon-form-application','PhinCon Form Application','This Page Content PhinCon Form that usually being used by all PhinConers. Hopefully this information could help all Phinconners. You can download by click the link below : 1. Transport Claim Form 2. leave Claim Form 3. Payment Request Form 4. Medical Clai','2013-03-19 16:17:49','7c53ecb7858b5d195261d0eb88edef8b',1,1,1,'*','2010-01-29 04:27:54','0000-00-00 00:00:00','2010-01-29 04:27:54','0000-00-00 00:00:00',0,0,1,'O:19:\"FinderIndexerResult\":18:{s:11:\"\0*\0elements\";a:25:{s:2:\"id\";s:3:\"391\";s:5:\"alias\";s:24:\"phincon-form-application\";s:7:\"summary\";s:1696:\"<p style=\"font-family: Lucida Fax; font-size: 10pt; line-height: 25pt; color: #000080;\"><strong>This Page Content PhinCon Form that usually being used by all PhinConers.</strong></p>\r\n<p style=\"font-family: Lucida Fax; font-size: 10pt; line-height: 25pt; color: #000080;\"><strong>Hopefully this information could help all Phinconners.</strong></p>\r\n<p style=\"font-family: Lucida Fax; font-siz